enia PHP %s','%s license'=>'%s licencja','self version %s'=>'wersja własna %s','and'=>'i','Custom Coupon Codes'=>'Własne kody kuponów','Maximum Usage Limit'=>'Maksymalny limit użycia','Percentage or Fixed Discounts'=>'Zniżki procentowe lub stałe','Once Per Email Address Limit'=>'Limit „raz na adres e-mail”','Start and End Dates'=>'Daty początkowa i końcowa','Usage Statistics'=>'Statystyki użytkowania','Coupons Overview'=>'Przegląd kuponów','Coupon Settings'=>'Ustawienia kuponu','Easy to Use, Yet Powerful'=>'Łatwy w użyciu, ale bogaty w funkcje','With the Coupons addon, you can offer customers discounts using custom coupon codes. Create your own percentage or fixed rate discount, then add the Coupon field to any payment form. When a customer enters your unique code, they’ll receive the specified discount. You can also add limits to restrict when coupons are available and how often they can be used. The Coupons addon requires a license level of Pro or higher.%s'=>'Dzięki dodatkowi Coupons możesz oferować klientom zniżki za pomocą własnych kodów kuponów. Utwórz własną zniżkę procentową lub kwotową, a następnie dodaj pole kuponu do dowolnego formularza płatności. Gdy klient wprowadzi twój unikatowy kod, otrzyma określoną zniżkę. Możesz także dodawać limity ograniczające czas dostępności kuponów i częstotliwość ich stosowania. Dodatek Coupons wymaga licencji na poziomie Pro lub wyższym.%s','<p>Stripe Payments must be enabled when using the Stripe Credit Card field.</p><p>To proceed, please go to <strong>Payments » Stripe</strong> and check <strong>Enable Stripe payments</strong>.</p>'=>'<p>W przypadku korzystania z pola karty kredytowej Stripe muszą być włączone płatności Stripe.</p><p>Aby kontynuować, przejdź do obszaru <strong>Płatności » Stripe</strong> i zaznacz <strong>Włącz płatności Stripe</strong>.</p>','This page is insecure. Credit Card field should be used for testing purposes only.'=>'Ta strona jest niezabezpieczona. Pola karty kredytowej należy używać wyłącz