łącz płatności Stripe','Payment Description'=>'Opis płatności','Enter your payment description. Eg: Donation for the soccer team. Only used for standard one-time payments.'=>'Podaj opis płatności. Na przykład: Darowizna na drużynę piłkarską. Pole używane wyłącznie do standardowych płatności jednorazowych.','Stripe Payment Receipt'=>'Potwierdzenie płatności Stripe','--- Select Email ---'=>'--- Wybierz adres e-mail ---','If you would like to have Stripe send a receipt after payment, select the email field to use. This is optional but recommended. Only used for standard one-time payments.'=>'Jeśli chcesz, aby po płatności serwis Stripe wysłał jej potwierdzenie, wybierz odpowiednie pole adresu e-mail. Jest to opcjonalne, ale zalecane. Pole używane wyłącznie do standardowych płatności jednorazowych.','Select the field that contains the customer\'s email address. This is optional but recommended.'=>'Wybierz pole zawierające adres e-mail klienta. Jest to opcjonalne, ale zalecane.','Enable recurring subscription payments'=>'Włącz cykliczne płatności subskrypcyjne','Plan Name'=>'Nazwa planu','Enter the subscription name. Eg: Email Newsletter. Subscription period and price are automatically appended. If left empty the form name will be used.'=>'Wpisz nazwę subskrypcji. Na przykład: Biuletyn e-mail. Okres subskrypcji i cena są dołączane automatycznie. Jeśli pozostawisz to pole puste, zostanie użyta nazwa formularza.','Recurring Period'=>'Okres cykliczny','Daily'=>'Codziennie','Monthly'=>'Co miesiąc','Semi-Yearly'=>'Co pół roku','How often you would like the charge to recur.'=>'Jak często ma być ponawiane obciążenie.','Select the field that contains the customer\'s email address. This field is required.'=>'Wybierz pole zawierające adres e-mail klienta. To pole jest wymagane.','Stripe is not connected for your current payment mode. Please press the "Connect with Stripe" button to complete this setup.'=>'Serwis Stripe nie jest połączony z obecnym trybem płatności. Naciśnij przycisk „Połącz ze Stripe”, aby dokończyć tę konfigurację.','The connected Stripe account does not support the selected currency. Please connect a different account or change the currency.'=>'Połączone konto Stripe nie obsługuje wybranej waluty. Połącz inne konto lub zmień walutę.','<p>Switching test/live modes requires Stripe account reconnection.</p><p>Press the <em>"Connect with Stripe"</em> button after saving the settings to reconnect.</p>'=>'<p>Przełączanie trybów na żywo / testowego wymaga ponownego połączenia konta Stripe.</p><p>Po zapisaniu ustawień naciśnij przycisk <em>Połącz ze Stripe</em>, aby ponownie połączyć konto.</p>','Connection Status'=>'Status połączenia','Test Mode'=>'Tryb testowy','Credit Card Field Mode'=>'Tryb pola karty kredytowej','Card Element'=>'Element karty','Payment Element'=>'Element płatności','Name, Email, Single Line Text, Paragraph Text, Dropdown, Multiple Choice, Checkboxes, Numbers, Number Slider, and Payment Fields (Single Item, Total, etc.)'=>'Imię i nazwisko, adres e-mail, jeden wiersz tekstu, akapit tekstu, lista rozwijana, wybór wielokrotny, pola wyboru, liczby, suwak z liczbą i pola płatności (jedna pozycja, suma itp.)','%d payment was successfully permanently deleted.'=>'Nieodwracalnie usunięto %d płatność.' . "\0" . 'Nieodwracalnie usunięto %d płatności.' . "\0" . 'Nieodwracalnie usunięto %d płatności.','%d payment was successfully restored.'=>'Przywrócono %d płatność.' . "\0" . 'Przywrócono %d płatności.' . "\0" . 'Przywrócono %d płatności.','%d payment was successfully moved to the Trash.'=>'Przeniesiono %d płatność do kosza.' . "\0" . 'Przeniesiono %d płatności do kosza.' . "\0" . 'Przeniesiono %d płatności do kosza.','Are you sure you want to delete this payment and all its information (details, notes, etc.)?'=>'Czy na pewno chcesz usunąć tę płatność i wszystkie informacje na jej temat (szczegóły, notatki itp.)?','One-Time'=>'Jednorazowa','Weekly'=>'Co tydzień','Quarterly'=>'Co kwartał','Yearly'=>'Co rok','<strong>Pay-as-you-go Pricing</strong><br>3%% fee per-transaction + Stripe fees. <a href="%s">Activate your license</a> to remove additional fees and unlock powerful features.'=>'<strong>Opłaty ponoszone na bieżąco:</strong><br>Opłata w wysokości 3%% za transakcję + opłaty serwisu Stripe. <a href="%s">Włącz licencję</a>, aby pozbyć się dodatkowych opłat i uzyskać dostęp do zaawansowanych funkcji.','<strong>Pay-as-you-go Pricing</strong><br> 3%% fee per-transaction + Stripe fees. <a href="%s" target="_blank">Upgrade to Pro</a> to remove additional fees and unlock powerful features.'=>'<strong>Opłaty ponoszone na bieżąco:</strong><br> Opłata w wysokości 3%% za transakcję + opłaty serwisu Stripe. <a href="%s" target="_blank">Kup Pro</a>, aby pozbyć się dodatkowych opłat i uzyskać dostęp do zaawansowanych funkcji.','Prevent Stripe from processing live transactions. Please see <a href="%s" target="_blank" rel="noopener noreferrer">our documentation on Stripe test payments</a> for full details.'=>'Zapobiegaj przetwarzaniu transakcji na żywo przez Stripe. Aby uzyskać szczegółowe informacje, zapoznaj się z <a href="%s" target="_blank" rel="noopener noreferrer">dokumentacją dotyczącą płatności testowych Stripe</a>.','Found <strong>%d payment</strong>'=>'Znaleziono <strong>%d płatność</strong>' . "\0" . 'Znaleziono <strong>%d płatności</strong>' . "\0" . 'Znaleziono <strong>%d płatności</strong>','Please enter a valid email address. Your notifications won\'t be sent if the field is not filled in correctly.'=>'Wpisz prawidłowy adres e-mail. Jeśli to pole nie zostanie poprawnie wypełnione, powiadomienia nie będą wysyłane.','Notifications can only use 1 From Email. Please do not enter multiple addresses.'=>'W powiadomieniach może być używany tylko 1 adres e-mail nadawcy. Nie wpisuj wielu adresów.','Get Started'=>'Rozpocznij','Easily add your contact form'=>'Łatwo dodaj formularz kontaktowy','Oh hey, it looks like you\'re working on a contact page. Don\'t forget to embed your contact form. Click the plus icon above and search for WPForms.'=>'Oho, wygląda na to, że pracujesz nad stroną kontaktu. Nie zapomnij o osadzeniu formularza kontaktowego. Kliknij powyższą ikonkę plusa i wyszukaj WPForms.','Embed your form'=>'Osadź formularz','Then click on the WPForms block to embed your desired contact form.'=>'Następnie kliknij blok WPForms, aby osadzić żądany formularz kontaktowy.','Don\'t forget to embed your contact form. Simply click the Add Form button below.'=>'Nie zapomnij o osadzeniu formularza kontaktowego. Po prostu kliknij poniższy przycisk Dodaj formularz.','Did you know that with <a href="%1$s" target="_blank" rel="noopener noreferrer">WPForms</a>, you can create an easy-to-use contact form in a matter of minutes?'=>'Czy wiesz, że za pomocą wtyczki <a href="%1$s" target="_blank" rel="noopener noreferrer">WPForms</a> możesz w kilka minut utworzyć łatwy w obsłudze formularz kontaktowy?','You\'ve already created a form, now add it to the page so your customers can get in touch.'=>'Twój formularz jest już gotowy – teraz dodaj go do strony, aby klienci mogli się z tobą kontaktować.','Dismiss this notice'=>'Odrzuć to powiadomienie','Make Sure Important Emails Reach Your Customers'=>'Zadbaj o to, aby ważne e-maile docierały do klientów','Solve common email deliverability issues for good. <a href="%1$s" target="%2$s" rel="noopener noreferrer">Get WP Mail SMTP!</a>'=>'Skutecznie rozwiąż typowe problemy z dostarczaniem e-maili. <a href="%1$s" target="%2$s" rel="noopener noreferrer">Pobierz wtyczkę WP Mail SMTP!</a>','Oh hey, it looks like you\'re working on a Contact page.'=>'Oho, wygląda na to, że pracujesz nad stroną kontaktu.','Use Modern Markup'=>'Użyj nowoczesnych znaczników','<strong>You cannot use modern markup because you’re using the deprecated Credit Card field.</strong> If you’d like to use modern markup, replace your credit card field with a payment gateway like <a href="%s" target="_blank" rel="noopener noreferrer">Stripe</a>.'=>'<strong>Nie możesz użyć nowoczesnych znaczników, ponieważ korzystasz z przestarzałego pola karty kredytowej.</strong> Jeśli chcesz użyć nowoczesnych znaczników, zastąp pole karty kredytowej bramką płatności, taką jak <a href="%s" target="_blank" rel="noopener noreferrer">Stripe</a>.','%1$s Invalid email address %2$s.'=>'%1$s – nieprawidłowy adres e-mail %2$s.','%s Empty subject line.'=>'%s – pusty wiersz tematu.','%s Empty message.'=>'%s – pusta wiadomość.','Form error message'=>'Komunikat o błędzie formularza','Recaptcha error message'=>'Komunikat o błędzie Recaptcha','Error message'=>'Komunikat o błędzie','Submit button is disabled during form submission.'=>'Podczas przesyłania formularza przycisk Prześlij jest wyłączony.','Field Styles'=>'Style pól','Label Styles'=>'Style etykiet','Button Styles'=>'Style przycisków','Also used for other fields like Multiple Choice, Checkboxes, Rating, and NPS Survey.'=>'Opcja używana także w odniesieniu do innych pól, takich jak wielokrotny wybór, pola wyboru, ocena i ankieta NPS.','Additional CSS Classes'=>'Dodatkowe klasy CSS','Want to customize your form styles without editing CSS?'=>'Chcesz dostosowywać style formularza bez edytowania arkusza CSS?','Update WordPress to the latest version to use our modern markup and unlock the controls below.'=>'Zaktualizuj WordPressa do najnowszej wersji, aby skorzystać z nowoczesnych znaczników i uzyskać dostęp do poniższych elementów sterujących.','Enable modern markup in your WPForms settings to unlock the controls below.'=>'Włącz nowoczesne znaczniki w ustawieniach wtyczki WPForms, aby uzyskać dostęp do poniższych elementów sterujących.','Form Styles are disabled because Lead Form Mode is turned on.'=>'Style formularzy są wyłączone, ponieważ jest włączony tryb formularza potencjalnych klientów.','To change the styling for this form, open it in the form builder and edit the options in the Lead Forms settings.'=>'Aby zmienić styl tego formularza, otwórz go w kreatorze formularzy i zmodyfikuj opcje dostępne w ustawieniach formularzy potencjalnych klientów.','Size'=>'Rozmiar','Background'=>'Tło','Border'=>'Obramowanie','Border Radius'=>'Promień obramowania','Colors'=>'Kolory','Sublabel & Hint'=>'Etykieta podrzędna i podpowiedź','Error Message'=>'Komunikat o błędzie','Reset Style Settings'=>'Zresetuj ustawienia stylu','Are you sure you want to reset the style settings for this form? All your current styling will be removed and canʼt be recovered.'=>'Czy na pewno chcesz zresetować ustawienia stylu tego formularza? Wszystkie aktualne elementy stylu zostaną usunięte i nie będzie można ich odzyskać.','Yes, Reset'=>'Tak, zresetuj','Copy / Paste Style Settings'=>'Skopiuj/wklej ustawienia stylu','There was an error parsing your JSON code. Please check your code and try again.'=>'Podczas analizowania kodu JSON wystąpił błąd. Sprawdź kod i spróbuj ponownie.','If you\'ve copied style settings from another form, you can paste them here to add the same styling to this form. Any current style settings will be overwritten.'=>'Jeśli ustawienia stylu zostały skopiowane z innego formularza, możesz je skopiować tutaj, aby dodać ten sam styl do tego formularza. Wszelkie obecne ustawienia stylu zostaną zastąpione.','Dismiss this notice.'=>'Odrzuć to powiadomienie.','Dark'=>'Ciemny','Light'=>'Jasny','WP Charitable'=>'WP Charitable','Top-rated WordPress donation and fundraising plugin. Over 10,000+ non-profit organizations and website owners use Charitable to create fundraising campaigns and raise more money online.'=>'Wysoko oceniana wtyczka do WordPressa służąca do obsługi darowizn i zbiórek pieniężnych. Ponad 10 000 organizacji non profit i właścicieli witryn internetowych używa Charitable do tworzenia kampanii fundraisingowych i zbierania pieniędzy online.','WPCode'=>'WPCode','Future proof your WordPress customizations with the most popular code snippet management plugin for WordPress. Trusted by over 1,500,000+ websites for easily adding code to WordPress right from the admin area.'=>'Przygotuj funkcje dostosowywania swojej witryny na przyszłe wyzwania przy użyciu najpopularniejszej wtyczki do WordPressa umożliwiającej zarządzanie fragmentami kodu. Cieszy się ona zaufaniem administratorów ponad 1 500 000 witryn internetowych, ponieważ umożliwia łatwe dodawanie kodu do WordPressa bezpośrednio z obszaru administratora.','Duplicator'=>'Duplicator','Leading WordPress backup & site migration plugin. Over 1,500,000+ smart website owners use Duplicator to make reliable and secure WordPress backups to protect their websites. It also makes website migration really easy.'=>'Czołowa wtyczka do WordPressa służąca do tworzenia kopii zapasowych i migracji witryn. Ponad 1 500 000 rozsądnych właścicieli witryn internetowych w WordPressie używa wtyczki Duplicator do ochrony witryn przez tworzenie ich kopii zapasowych. Wtyczka znacznie ułatwia też migrację witryn internetowych.','Basic Protection, reCAPTCHA, hCaptcha, Cloudflare Turnstile and Akismet'=>'Ochrona podstawowa, reCAPTCHA, hCaptcha, Cloudflare Turnstile i Akismet','Basic Protection, reCAPTCHA, hCaptcha, Cloudflare Turnstile, Akismet, Country Filter, Keyword Filter, and Custom Captcha'=>'Ochrona podstawowa, reCAPTCHA, hCaptcha, Cloudflare Turnstile, Akismet, filtr krajów, filtr słów kluczowych i własny test Captcha','VIP Circle'=>'VIP Circle','Made with ♥ by the WPForms Team'=>'Stworzona z ♥ przez zespół WPForms','Enable Cloudflare Turnstile'=>'Włącz funkcję Cloudflare Turnstile','Enable free, CAPTCHA-like spam protection that protects data privacy.'=>'Włącz bezpłatną ochronę przed spamem przypominającą test CAPTCHA, która zabezpiecza prywatność danych.','Cloudflare Turnstile'=>'Cloudflare Turnstile','Not sure which service is right for you? <a href="%s" target="_blank" rel="noopener noreferrer">Check out our comparison</a> for more details.'=>'Nie wiesz, która sprawdzi się u ciebie? <a href="%s" target="_blank" rel="noopener noreferrer">Zapoznaj się z porównaniem</a>, aby uzyskać więcej informacji.','Cloudflare Turnstile verification failed, please try again later.'=>'Weryfikacja Cloudflare Turnstile nie powiodła się. Spróbuj ponownie później.','Cloudflare Turnstile is a free, CAPTCHA-like service for preventing form spam while protecting data privacy. It offers a user-friendly experience by confirming visitors are real humans without requiring them to solve puzzles or math questions.'=>'Cloudflare Turnstile to bezpłatna usługa w stylu CAPTCHA, która zapobiega spamowi w formularzach, a jednocześnie chroni prywatność danych. Udostępnia ona przyjazne w obsłudze środowisko, ponieważ umożliwia gościom potwierdzanie, że naprawdę są ludźmi, nie wymagając od nich rozwiązywania zagadek ani odpowiadania na pytania matematyczne.','For more details on how Turnstile works, as well as a step by step setup guide, please check out our <a href="%s" target="_blank" rel="noopener noreferrer">documentation</a>.'=>'Aby uzyskać więcej informacji na temat sposobu działania usługi Turnstile i zapoznać się ze szczegółowym przewodnikiem, zajrzyj do naszej <a href="%s" target="_blank" rel="noopener noreferrer">dokumentacji</a>.','Free Plugins'=>'Bezpłatne wtyczki','Auto'=>'Automatycznie','Done!'=>'Gotowe!','You can’t import forms because you don’t have unfiltered HTML permissions. Please contact your site administrator or <a href="%s" target="_blank" rel="noopener noreferrer">reach out to our support team</a>.'=>'Nie możesz importować formularzy, ponieważ nie masz uprawnienia „unfiltered HTML”. Skontaktuj się z administratorem witryny lub z <a href="%s" target="_blank" rel="noopener noreferrer">naszym zespołem pomocy technicznej</a>.','Uh oh!'=>'O-o!','In order to use the Icon Choices feature, an icon library must be downloaded and installed. It\'s quick and easy, and you\'ll only have to do this once.'=>'Aby umożliwić korzystanie z funkcji opcji do wyboru z ikonkami, należy pobrać i zainstalować bibliotekę ikonek. Jest to czynność szybka, łatwa i wykonywana tylko raz.','Installing Icon Library'=>'Instalowanie biblioteki ikonek','This should only take a minute. Please don’t close or reload your browser window.'=>'To powinno potrwać nie dłużej niż minutę. Nie zamykaj okna przeglądarki ani nie wczytuj go ponownie.','The icon library has been installed successfully. We will now save your form and reload the form builder.'=>'Biblioteka ikonek została zainstalowana. Teraz zapiszemy formularz i ponownie wczytamy kreator formularzy.','There was an error installing the icon library. Please try again later or <a href="%s" target="_blank" rel="noreferrer noopener">contact support</a> if the issue persists.'=>'Podczas instalowania biblioteki ikonek wystąpił błąd. Spróbuj ponownie później, a jeśli problem nie ustąpi, <a href="%s" target="_blank" rel="noreferrer noopener">skontaktuj się z zespołem pomocy technicznej</a>.','The icon library appears to be missing or damaged. It will now be reinstalled.'=>'Wygląda na to, że brakuje biblioteki ikonek lub jest ona uszkodzona. Zostanie teraz zainstalowana ponownie.','Icon Picker'=>'Selektor ikonek','Browse or search for the perfect icon.'=>'Wyszukaj idealną ikonkę.','Search 2000+ icons...'=>'Wyszukaj w ponad 2000 ikonkach...','Sorry, we didn\'t find any matching icons.'=>'Niestety, nie znaleziono pasujących ikonek.','Incorrect usage of this operation.'=>'Niepoprawne użycie tej operacji.','Use icon choices'=>'Użyj opcji do wyboru z ikonkami','Enable this option to use icons with the choices.'=>'Włącz tę opcję, aby razem z opcjami do wyboru używać ikonek.','Select an accent color for the icon choices.'=>'Wybierz kolor wiodący opcji do wyboru z ikonkami.','Icon Choice Style'=>'Styl opcji do wyboru z ikonkami','Select the style for the icon choices.'=>'Wybierz styl opcji do wyboru z ikonkami.','Enter the email address or email address with recipient\'s name in "First Last %s" format.'=>'Wpisz adres e-mail albo adres e-mail z imieniem i nazwiskiem odbiorcy w formacie „Imię nazwisko %s”.','Icon Color'=>'Kolor ikonek','Icon Size'=>'Rozmiar ikonek','Select icon size.'=>'Wybierz rozmiar ikonek.','Entries are securely backed up in the cloud. Upgrade to restore.'=>'Wpisy są bezpieczne dzięki kopiom zapasowym tworzonym w chmurze. Aby je przywrócić, ulepsz swój plan.','Basic Anti-Spam Settings'=>'Podstawowe ustawienia antyspamowe','Additional Anti-Spam Settings'=>'Dodatkowe ustawienia antyspamowe','Multi-page Forms, File Upload Forms, Multiple Form Notifications, File Upload and CSV Attachments, Conditional Form Confirmation'=>'Formularze wielostronicowe, formularze przesyłania plików, wiele powiadomień o formularzu, przesyłanie plików i załączniki CSV, warunkowe potwierdzanie formularza','Multi-page Forms, File Upload Forms, Multiple Form Notifications, File Upload and CSV Attachments, Conditional Form Confirmation, Save and Resume Form'=>'Formularze wielostronicowe, formularze przesyłania plików, wiele powiadomień o formularzu, przesyłanie plików i załączniki CSV, warunkowe potwierdzanie formularza, zapisywanie i wznawianie formularza','Missing form data on form submission process %s'=>'Brak danych formularza podczas procesu przesyłania formularza – %s','Form data is not an array in `\\WPForms_Process::process()`. It might be caused by incorrect data returned by `wpforms_process_before_form_data` filter. Verify whether you have a custom code using this filter and debug value it is returning.'=>'Dane formularza nie są tablicą w lokalizacji „\\WPForms_Process::process()”. Przyczyną mogą być niepoprawne dane zwrócone przez filtr „wpforms_process_before_form_data”. Sprawdź, czy z tego filtru nie korzysta jakiś własny kod, a jeśli tak – zdebuguj zwracaną przez niego wartość.','Your form has not been submitted because data is missing from the entry.'=>'Formularz nie został przesłany ze względu na brakujące dane we wpisie.','Check the WPForms &raquo; Tools &raquo; <a href="%s">Logs</a> for more details.'=>'Aby uzyskać szczegółowe informacje, sprawdź WPForms &raquo; Narzędzia &raquo; <a href="%s">Dzienniki</a>.','Error ID: %s.'=>'Identyfikator błędu: %s.','Turn on invisible spam protection.'=>'Włącz niewidoczną ochronę przed spamem.','Behind-the-scenes spam filtering that\'s invisible to your visitors.'=>'Zakulisowe filtrowanie spamu, które nie jest widoczne dla gości.','Protection'=>'Ochrona','Also Available'=>'Również dostępne','Enable third-party CAPTCHAs to prevent form submissions from bots.'=>'Włącz funkcje CAPTCHA innych firm, aby zapobiec przesyłaniu formularzy przez boty.','Automated tests that help to prevent bots from submitting your forms.'=>'Automatyczne testy, które pomagają zapobiegać przesyłaniu formularzy przez boty.','Get Started &rarr;'=>'Rozpocznij &rarr;','Country Filter'=>'Filtr krajów','Stop spam at its source. Allow or deny entries from specific countries.'=>'Powstrzymuj spam u źródła. Zezwalaj na wpisy lub blokuj wpisy z określonych krajów.','Keyword Filter'=>'Filtr słów kluczowych','Block form entries that contain specific words or phrases that you define.'=>'Blokuj wpisy formularzy zawierających określone słowa lub frazy.','Ask custom questions or require your visitor to answer a random math puzzle.'=>'Zadawaj własne pytania lub wymagaj od gości rozwiązania losowej zagadki matematycznej.','Add to Form'=>'Dodaj do formularza','Add Google\'s free anti-spam service and choose between visible or invisible CAPTCHAs.'=>'Dodaj bezpłatną usługę antyspamową od Google i wybierz widoczny lub niewidoczny test CAPTCHA.','Turn on free, privacy-oriented spam prevention that displays a visual CAPTCHA.'=>'Włącz bezpłatną funkcję zapobiegania spamowi ukierunkowaną na ochronę prywatności, która wyświetla wizualny test CAPTCHA.','Integrate the powerful spam-fighting service trusted by millions of sites.'=>'Zintegruj zaawansowaną usługę przeciwdziałania spamowi, której zaufali administratorzy milionów witryn.','Insert into form'=>'Wstaw do formularza','Uploaded to this form'=>'Przesłano do tego formularza','Add Media'=>'Dodaj multimedia','Visual'=>'Wizualne','Text'=>'Tekst','<h4>Add Text and Images to Your Form With Ease</h4> <p>To get started, replace this text with your own.</p>'=>'<h4>Łatwo dodaj do formularza tekst i obrazki</h4> <p>Aby rozpocząć, zastąp ten tekst własnym.</p>','Expand Editor'=>'Rozwiń edytor','Collapse Editor'=>'Zwiń edytor','Update Preview'=>'Zaktualizuj podgląd','Favorite Templates'=>'Ulubione szablony','New Templates'=>'Nowe szablony','Enable File Upload Attachments'=>'Włącz załączniki z przesłanymi plikami','File Upload Attachments'=>'Załączniki z przesłanymi plikami','Our form builder is optimized for desktop computers.'=>'Nasz kreator formularzy jest zoptymalizowany pod kątem komputerów stacjonarnych.','We recommend that you edit your forms on a bigger screen. If you\'d like to proceed, please understand that some functionality might not behave as expected.'=>'Zalecamy edytowanie formularzy na większym ekranie. Jeśli chcesz kontynuować, zwracamy uwagę, że niektóre funkcje mogą nie działać zgodnie z oczekiwaniami.','Spam Protection and Security'=>'Ochrona przed spamem i zabezpieczenia','Recommended'=>'Zalecane','WPForms Templates'=>'Szablony WPForms','Get Access to Our Library of %d Pre-Made Form Templates'=>'Uzyskaj dostęp do biblioteki %d gotowych szablonów formularzy','Layout'=>'Układ','Get a Head Start With Our Pre-Made Form Templates'=>'Szybko rozpocznij pracę dzięki gotowym szablonom formularzy','Choose a template to speed up the process of creating your form. You can also start with a <a href="#" class="wpforms-trigger-blank">blank form</a> or <a href="%1$s" target="_blank" rel="noopener noreferrer">create your own</a>. <br>Have a suggestion for a new template? <a href="%2$s" target="_blank" rel="noopener noreferrer">We’d love to hear it</a>!'=>'Wybierz szablon, aby przyspieszyć tworzenie formularza. Możesz zacząć od <a href="#" class="wpforms-trigger-blank">pustego formularza</a> lub <a href="%1$s" target="_blank" rel="noopener noreferrer">utworzyć własny</a>. <br>Masz propozycję nowego szablonu? <a href="%2$s" target="_blank" rel="noopener noreferrer">Chętnie ją poznamy</a>!','Sorry, we didn\'t find any templates that match your criteria.'=>'Niestety, nie znaleźliśmy szablonów pasujących do podanych kryteriów.','Available Templates'=>'Dostępne szablony','Create Form'=>'Utwórz formularz','Enable Entry CSV Attachment'=>'Włącz załącznik CSV z wpisami','Entry CSV Attachment'=>'Załącznik CSV z wpisami','Remove from Favorites'=>'Usuń z ulubionych','Mark as Favorite'=>'Oznacz jako ulubiony','After purchasing a license, just <strong>enter your license key on the WPForms Settings page</strong>. This will let your site automatically upgrade to %s! (Don\'t worry, all your forms and settings will be preserved.)'=>'Po kupieniu licencji po prostu <strong>wpisz klucz licencyjny na stronie ustawień wtyczki WPForms</strong>. Dzięki temu w twojej witrynie nastąpi automatyczne ulepszenie do planu %s! (Spokojnie: wszystkie formularze i ustawienia zostaną zachowane).','Never start from scratch again! While WPForms Lite allows you to create any type of form, you can save even more time with WPForms Pro. Upgrade to access hundreds more form templates and advanced form fields.'=>'Nie zaczynaj od zera! Za pomocą WPForms Lite utworzysz formularz dowolnego rodzaju, jednak plan WPForms Pro pozwala zaoszczędzić jeszcze więcej czasu. Kup go, aby uzyskać dostęp do setek innych szablonów formularzy i zaawansowanych pól.','Enter label for the form field call to action button. The label will be ignored if the field has extended description content: in that case button will be used to expand the description content.'=>'Wpisz etykietę przycisku wezwania do działania w polu formularza. Jeśli pole ma rozszerzoną treść opisu, etykieta będzie ignorowana: w takim przypadku przycisk będzie służył do rozwijania treści opisu.','CTA Link'=>'Odnośnik wezwania do działania','Enter the URL for the form field call to action button. URL will be ignored if the field has extended description content: in that case button will be used to expand the description content.'=>'Wpisz adres URL przycisku wezwania do działania w polu formularza. Jeśli pole ma rozszerzoną treść opisu, adres URL będzie ignorowany: w takim przypadku przycisk będzie służył do rozwijania treści opisu.','CTA is hidden if Expanded Content is used.'=>'W przypadku użycia treści rozszerzonej wezwanie do działania jest ukryte.','You should enter a valid absolute address to the CTA Link field or leave it empty.'=>'W polu Odnośnik wezwania do działania należy wpisać prawidłowy adres bezwzględny lub pozostawić pole puste.','Dismiss'=>'Odrzuć','This field is disabled in the editor mode.'=>'To pole jest wyłączone w trybie edytora.','#%d (no name)'=>'#%d (brak nazwy)','The "Authorization Code" is required.'=>'„Kod autoryzacji” jest polem wymaganym.','The "Account Nickname" is required.'=>'„Pseudonim konta” jest polem wymaganym.','PayPal Commerce'=>'PayPal Commerce','Anti-spam verification failed, please try again later.'=>'Weryfikacja antyspamowa nie powiodła się. Spróbuj ponownie później.','The current \'From Email\' address does not match your website domain name (%1$s). This can cause your notification emails to be blocked or marked as spam.'=>'Bieżąca wartość „Adres e-mail nadawcy” nie pasuje do nazwy domeny twojej witryny internetowej (%1$s). Może to spowodować blokowanie e-maili z powiadomieniami lub ich oznaczanie jako spam.','We strongly recommend that you install the free <a href="%1$s" target="_blank">WP Mail SMTP</a> plugin! The Setup Wizard makes it easy to fix your emails.'=>'Zdecydowanie warto zainstalować bezpłatną wtyczkę <a href="%1$s" target="_blank">WP Mail SMTP</a>! Kreator konfiguracji ułatwia rozwiązywanie problemów z e-mailami.','Alternately, try using a From Address that matches your website domain (no-reply@%1$s).'=>'Ewentualnie spróbuj użyć adresu e-mail nadawcy zgodnego z domeną twojej witryny (no-reply@%1$s).','Please check out our <a href="%1$s" target="_blank" rel="noopener noreferrer">doc on fixing email delivery issues</a> for more details.'=>'Więcej informacji znajdziesz w <a href="%1$s" target="_blank" rel="noopener noreferrer">dokumencie na temat rozwiązywania problemów z dostarczaniem e-maili</a>.','This feature cannot be used at this time because the Akismet plugin <a href="%1$s" target="_blank" rel="noopener noreferrer">has not been installed</a>. For information on how to use this feature please <a href="%2$s" target="_blank" rel="noopener noreferrer">refer to our documentation</a>.'=>'Obecnie nie można skorzystać z tej funkcji, ponieważ wtyczka Akismet <a href="%1$s" target="_blank" rel="noopener noreferrer">nie została zainstalowana</a>. Aby uzyskać informacje na temat sposobu korzystania z tej funkcji, <a href="%2$s" target="_blank" rel="noopener noreferrer">zajrzyj do dokumentacji</a>.','This feature cannot be used at this time because the Akismet plugin <a href="%1$s" target="_blank" rel="noopener noreferrer">has not been activated</a>. For information on how to use this feature please <a href="%2$s" target="_blank" rel="noopener noreferrer">refer to our documentation</a>.'=>'Obecnie nie można skorzystać z tej funkcji, ponieważ wtyczka Akismet <a href="%1$s" target="_blank" rel="noopener noreferrer">nie została włączona</a>. Aby uzyskać informacje na temat sposobu korzystania z tej funkcji, <a href="%2$s" target="_blank" rel="noopener noreferrer">zajrzyj do dokumentacji</a>.','This feature cannot be used at this time because the Akismet plugin <a href="%1$s" target="_blank" rel="noopener noreferrer">has not been properly configured</a>. For information on how to use this feature please <a href="%2$s" target="_blank" rel="noopener noreferrer">refer to our documentation</a>.'=>'Obecnie nie można skorzystać z tej funkcji, ponieważ wtyczka Akismet <a href="%1$s" target="_blank" rel="noopener noreferrer">nie została prawidłowo skonfigurowana</a>. Aby uzyskać informacje na temat sposobu korzystania z tej funkcji, <a href="%2$s" target="_blank" rel="noopener noreferrer">zajrzyj do dokumentacji</a>.','Accept payments using PayPal Commerce, Stripe, Square, and PayPal Standard'=>'Przyjmowanie płatności za pośrednictwem serwisów PayPal Commerce, Stripe, Square i PayPal Standard','Accept payments using PayPal Commerce, Stripe, Square, PayPal Standard, and Authorize.Net'=>'Przyjmowanie płatności za pośrednictwem serwisów PayPal Commerce, Stripe, Square, PayPal Standard i Authorize.Net','Please fill out the field in required format.'=>'Uzupełnij pole w wymaganym formacie.','Internal Information'=>'Informacje wewnętrzne','This field is not editable'=>'Tego pola nie można edytować','Heading'=>'Nagłówek','Enter text for the form field heading.'=>'Wpisz treść nagłówka pola.','Expanded Content'=>'Treść rozszerzona','Enter text for the form field expanded description.'=>'Wpisz treść rozszerzonego opisu pola formularza.','Adds an expandable content area below the description.'=>'Powoduje dodanie rozwijanego obszaru treści pod opisem.','CTA Label'=>'Etykieta wezwania do działania','Enable Akismet anti-spam protection'=>'Włącz ochronę antyspamową Akismet','Custom'=>'Własny','Use Simple Contact Form Template'=>'Użyj prostego szablonu formularza kontaktowego','The template you selected is currently not available, but you can try again later. If you continue to have trouble, please reach out to support.'=>'Wybrany szablon nie jest obecnie dostępny, ale możesz spróbować ponownie później. Jeśli problem nie ustąpi, skontaktuj się z zespołem pomocy technicznej.','Collect the names, emails, and messages from site visitors that need to talk to you.'=>'Zbieraj imiona i nazwiska, adresy e-mail oraz wiadomości od osób odwiedzających witrynę, które chcą się z tobą skontaktować.','Mapbox API'=>'Mapbox API','What’s Your Dream WPForms Feature?'=>'Masz wymarzoną funkcję wtyczki WPForms?','Share Your Idea'=>'Przekaż pomysł','Congratulations! You Just Got Your 100th Form Entry!'=>'Gratulacje! Masz setny wpis z formularza!','Watch Video'=>'Obejrzyj film','If you could add just one feature to WPForms, what would it be? We want to know! Our team is busy surveying valued customers like you as we plan the year ahead. We’d love to know which features would take your business to the next level! Do you have a second to share your idea with us?'=>'Gdybyśmy ci powiedzieli, że możesz dodać do wtyczki WPForms tylko jedną nową funkcję, jaka by to była funkcja? Naprawdę chcemy wiedzieć! Nasz zespół obecnie kontaktuje się z ważnymi klientami takimi jak ty w związku z opracowywaniem planów na najbliższy rok. Bardzo chętnie się dowiemy, jakie funkcje szczególnie by ci pomogły w rozwijaniu firmy! Czy masz chwilę na podzielenie się pomysłem?','You just hit 100 entries&hellip; and this is just the beginning! Now it’s time to dig into the data and figure out what makes your visitors tick. The User Journey addon shows you what your visitors looked at before submitting your form. Now you can easily find which areas of your site are triggering form conversions.'=>'Właśnie udało ci się uzyskać 100 wpisów&hellip; a to dopiero początek! Czas zagłębić się w dane i ustalić, co skłania twoich gości do działania. Dodatek User Journey pokazuje, co oglądali goście, zanim przesłali formularz. Teraz możesz się łatwo przekonać, które obszary twojej witryny skłaniają gości do wypełnienia formularza.','Your form entries can’t be backed up because WPForms can’t connect to the backup server. If you’d like to back up your entries, find out how to <a href="%s" target="_blank" rel="noopener noreferrer">fix entry backup issues</a>.'=>'Nie można utworzyć kopii zapasowej wpisów formularza, ponieważ wtyczka WPForms nie może się połączyć z serwerem kopii zapasowych. Jeśli chcesz utworzyć kopię zapasową wpisów, poznaj sposoby <a href="%s" target="_blank" rel="noopener noreferrer">rozwiązywania problemów z kopiami zapasowymi wpisów</a>.','Record ID not found'=>'Nie znaleziono identyfikatora rekordu','No such record.'=>'Nie ma takiego rekordu.','Unique Value'=>'Wartość unikatowa','Update'=>'Zaktualizuj','Below is the total number of submissions for each form. However, form entries are not stored by WPForms Lite.'=>'Poniżej pokazano łączną liczbę przesłań każdego formularza. Jednak wpisy formularzy nie są przechowywane w WPForms Lite.','We’ve got you covered!'=>'Wszystko pod kontrolą!','Check out what else you’ll get with your Pro license.'=>'Sprawdź, co jeszcze da ci licencja Pro.','Note: Entry backups are not enabled.'=>'Uwaga: kopie zapasowe wpisów nie są włączone.','We recommend that you enable entry backups to guard against lost entries.'=>'Zalecamy włączenie kopii zapasowych wpisów, aby się zabezpieczyć przed ich utratą.','Backups are completely free, 100%% secure, and you can turn them on in a few clicks! <a href="%s" target="_blank" rel="noopener noreferrer">Enable entry backups now.</a>'=>'Kopie zapasowe są całkowicie bezpłatne i stuprocentowo bezpieczne, a do ich włączenia wystarczy kilka kliknięć! <a href="%s" target="_blank" rel="noopener noreferrer">Włącz kopie zapasowe wpisów już teraz.</a>','Your entries are being backed up securely in the cloud. When you’re ready to manage your entries inside WordPress, just <a href="%s" target="_blank" rel="noopener noreferrer">upgrade to Pro</a> and we’ll automatically import them in seconds!'=>'Bezpieczne kopie zapasowe twoich wpisów są tworzone w chmurze. Gdy zechcesz zarządzać wpisami w WordPressie, po prostu <a href="%s" target="_blank" rel="noopener noreferrer">kup Pro</a>, a w mig automatycznie zaimportujemy wpisy!','When you’re ready to manage your entries inside WordPress, <a href="%s" target="_blank" rel="noopener noreferrer">upgrade to Pro</a> to import your entries.'=>'Gdy zechcesz zarządzać wpisami w WordPressie, <a href="%s" target="_blank" rel="noopener noreferrer">kup Pro</a>, aby zaimportować wpisy.','Start Building'=>'Rozpocznij tworzenie','Read the Guide'=>'Przeczytaj przewodnik','Don’t Miss Your Form Notification Emails!'=>'Nie przegap e-maili z powiadomieniami o formularzu!','Did you know that many WordPress sites are not properly configured to send emails? With the free WP Mail SMTP plugin, you can easily optimize your site to send emails, avoid the spam folder, and make sure your emails land in the recipient’s inbox every time.'=>'Czy wiesz, że wiele witryn w WordPressie jest nieprawidłowo skonfigurowanych do wysyłania e-maili? Korzystając z bezpłatnej wtyczki WP Mail SMTP, możesz łatwo zoptymalizować witrynę, aby wysyłać e-maile, zapobiegać ich umieszczaniu w folderze spamu i zapewnić dostarczenie każdej wysłanej wiadomości do skrzynki odbiorcy.','Want to Be a VIP? Join Now!'=>'Chcesz zostać VIP-em? Dołącz do grupy!','Running a WordPress site can be challenging. But help is just around the corner! Our Facebook group contains tons of tips and help to get your business growing! When you join our VIP Circle, you’ll get instant access to tips, tricks, and answers from a community of loyal WPForms users. Best of all, membership is 100% free!'=>'Prowadzenie witryny w WordPressie bywa wyzwaniem. Ale pomoc jest na wyciągnięcie ręki! Nasza grupa na Facebooku zawiera mnóstwo porad i pomocnych treści, które mogą ci ułatwić rozwijanie działalności. Kiedy dołączysz do VIP Circle, uzyskasz natychmiastowy dostęp do porad, wskazówek i odpowiedzi przekazywanych przez społeczność stałych użytkowników wtyczki WPForms. Co najlepsze, członkostwo w grupie jest całkowicie bezpłatne!','Join Now'=>'Dołącz','Want to Know What Your Customers Really Think?'=>'Chcesz wiedzieć, co naprawdę myślą twoi klienci?','Get More Leads From Your Forms!'=>'Pozyskuj więcej potencjalnych klientów za pomocą formularzy!','Nothing beats real feedback from your customers and visitors. That’s why many small businesses love our awesome Surveys and Polls addon. Instantly unlock full survey reporting right in your WordPress dashboard. And don’t forget: building a survey is easy with our pre-made templates, so you could get started within a few minutes!'=>'Nie ma to jak prawdziwe informacje zwrotne od klientów i gości. Dlatego wielu właścicieli małych firm uwielbia nasz fantastyczny dodatek Ankiety i sondy. Zapewnia on natychmiastowy dostęp do pełnych raportów z ankiet bezpośrednio w kokpicie WordPressa. I pamiętaj: nasze gotowe szablony znacznie ułatwiają tworzenie ankiety, skracając ten proces do zaledwie kilku minut!','Are your forms converting fewer visitors than you hoped? Often, visitors quit forms partway through. That can prevent you from getting all the leads you deserve to capture. With our Form Abandonment addon, you can capture partial entries even if your visitor didn’t hit Submit! From there, it’s easy to follow up with leads and turn them into loyal customers.'=>'Czy stopień konwersji gości w twoich formularzach nie odpowiada twoim oczekiwaniom? Wielu gości opuszcza formularz w trakcie jego wypełniania. Możesz przez to tracić część potencjalnych klientów. Dzięki naszemu dodatkowi Porzucenie formularza możesz rejestrować częściowe wpisy nawet wtedy, gdy gość nie kliknął przycisku Prześlij! Ułatwia to nawiązywanie kontaktu z potencjalnymi klientami i przekształcanie ich w lojalnych odbiorców.','We’re grateful that you chose WPForms for your website! Now that you’ve installed the plugin, you’re less than 5 minutes away from publishing your first form. To make it easy, we’ve got %s form templates to get you started!'=>'Dziękujemy za wybranie wtyczki WPForms do twojej witryny internetowej! Skoro już masz zainstalowaną wtyczkę, od opublikowania pierwszego formularza dzieli cię niespełna 5 minut. Aby ci to ułatwić, oferujemy %s szablonów formularzy na dobry początek!','We’ve detected the same text in your allowlist and denylist. To prevent a conflict, we’ve removed the following text from the list you’re currently viewing:'=>'Wykryliśmy tę samą treść na liście dozwolonych i liście niedozwolonych. Aby zapobiec konfliktom, usunęliśmy następującą treść z obecnie wyświetlonej listy:','Türkiye'=>'Turcja','Most likely, your session expired. Please reload the page.'=>'Prawdopodobnie sesja wygasła. Wczytaj stronę ponownie.','No forms selected when trying to add a tag to them.'=>'Nie wybrano formularzy przy próbie dodania do nich tagu.','No tags to choose from'=>'Brak tagów do wyboru','All Tags'=>'Wszystkie tagi','<strong>1 form</strong> selected for Bulk Edit.'=>'Wybrano <strong>1 formularz</strong> do edytowania zbiorczego.','<strong>%d forms</strong> selected for Bulk Edit.'=>'Wybrano <strong>formularze (%d)</strong> do edytowania zbiorczego.','Manage Tags'=>'Zarządzaj tagami','Delete tags that you\'re no longer using. Deleting a tag will remove it from a form, but will not delete the form itself.'=>'Usuń tagi, z których już nie korzystasz. Usunięcie tagu spowoduje jego usunięcie z formularza, ale nie usunięcie samego formularza.','Delete Tags'=>'Usuń tagi','You have <strong>1 tag</strong> selected for deletion.'=>'Wybrano <strong>1 tag</strong> do usunięcia.','You have <strong>%d tags</strong> selected for deletion.'=>'Wybrano <strong>tagi (%d)</strong> do usunięcia.','There are no tags to delete.<br>Please create at least one by adding it to any form.'=>'Brak tagów do usunięcia.<br>Utwórz co najmniej jeden tag, dodając go do dowolnego formularza.','1 tag was successfully deleted.'=>'Usunięto 1 tag.','Almost done!'=>'Prawie gotowe!','In order to update the tags in the forms list, please refresh the page.'=>'Aby zaktualizować tagi na liście formularzy, odśwież stronę.','Refresh'=>'Odśwież',', '=>', ','Save changes'=>'Zapisz zmiany','Filter'=>'Filtruj','Edit Tags'=>'Edytuj tagi','Welcome to WPForms!'=>'Witamy w WPForms!','Enter a %s nickname'=>'Wprowadź pseudonim połączenia %s','Press Enter or "," key to add new tag'=>'Naciśnij Enter lub klawisz przecinka, aby dodać nowy tag','Tags'=>'Tagi','Mark form with the tags. To create a new tag, simply type it and press Enter.'=>'Oznacz formularz tagami. Aby utworzyć nowy tag, po prostu go wpisz i naciśnij Enter.','Enable Prefill by URL'=>'Włącz wypełnianie wstępne według adresu URL','How to use Prefill by URL'=>'Jak używać wypełniania wstępnego według adresu URL','Graph Style'=>'Styl wykresu','Bar'=>'Słupkowy','Line'=>'Liniowy','Color Scheme'=>'Schemat kolorów','WordPress'=>'WordPress','Save Changes'=>'Zapisz zmiany','<strong>Your form entries are not being stored in WordPress, and your entry backups are not active.</strong> If there\'s a problem with deliverability, you\'ll lose form entries. We recommend that you enable Entry Backups, especially if you\'re considering <a href="%s" target="_blank" rel="noopener noreferrer" class="wpforms-upgrade-modal">upgrading to WPForms PRO</a>.'=>'<strong>Wpisy formularza nie są przechowywane w WordPressie, a kopie zapasowe wpisów nie są włączone.</strong> Jeśli wystąpi problem z dostarczaniem, utracisz wpisy formularza. Zalecamy włączenie kopii zapasowych wpisów, zwłaszcza jeśli rozważasz <a href="%s" target="_blank" rel="noopener noreferrer" class="wpforms-upgrade-modal">kupienie WPForms PRO</a>.','Entry Backups Enabled'=>'Włączono kopie zapasowe wpisów','Entry Backups Disabled'=>'Wyłączono kopie zapasowe wpisów','Form Entry Backups were successfully disabled.'=>'Kopie zapasowe wpisów formularza zostały wyłączone.','Unfortunately, the error occurs while updating Form Entry Backups setting. Please try again later.'=>'Niestety podczas aktualizowania ustawienia Kopie zapasowe wpisów formularza wystąpił błąd. Spróbuj ponownie później.','Enable Form Entry Backups'=>'Włącz kopie zapasowe wpisów formularza','Enable Form Entry Backups for Free'=>'Włącz bezpłatnie kopie zapasowe wpisów formularza','Lite Connect'=>'Lite Connect','Awesome! If you decide to upgrade to WPForms Pro, you can restore your entries and will have instant access to reports.'=>'Super! Jeśli postanowisz kupić WPForms Pro, zyskasz możliwość przywracania wpisów i natychmiastowy dostęp do raportów.','<strong>Your form entries are not being stored locally, but are backed up remotely.</strong> If you <a href="%s" target="_blank" rel="noopener noreferrer" class="wpforms-upgrade-modal">upgrade to WPForms PRO</a>, you can restore your entries and they’ll be available in the WordPress dashboard.'=>'<strong>Wpisy formularza nie są przechowywane lokalnie, ale są tworzone ich zdalne kopie zapasowe.</strong> Jeśli <a href="%s" target="_blank" rel="noopener noreferrer" class="wpforms-upgrade-modal">kupisz WPForms PRO</a>, zyskasz możliwość przywracania wpisów, tak aby były dostępne w kokpicie WordPressa.','since you enabled Lite Connect on %s'=>'od włączenia funkcji Lite Connect w dniu %s','Help Docs'=>'Dokumenty pomocy','Select timespan'=>'Wybierz przedział czasu','WPForms Widget'=>'Widżet WPForms','Text Widget'=>'Widżet tekstowy','Block Widget'=>'Widżet blokowy','Form locations'=>'Lokalizacje formularza','View form locations'=>'Zobacz lokalizacje formularza','Form Locations'=>'Lokalizacje formularza','Inactive widgets'=>'Nieaktywne widżety','Site editor template'=>'Szablon edytora witryny','(no title)'=>'(brak tytułu)','This is a preview of the latest saved revision of your form. If this preview does not match your form, save your changes and then refresh this page. This form preview is not publicly accessible.'=>'To jest podgląd ostatniej zapisanej wersji tego formularza. Jeśli podgląd różni się od formularza, zapisz zmiany i odśwież tę stronę. Podgląd formularza nie jest dostępny publicznie.','This is the Lite Connect endpoint page.'=>'To jest strona punktu końcowego Lite Connect.','Dismiss recommended plugin'=>'Odrzuć zalecaną wtyczkę','Entries are not stored in WPForms Lite'=>'Wpisy nie są przechowywane w WPForms Lite','Enable Entry Backups'=>'Włącz kopie zapasowe wpisów','Entries Backups Are Enabled'=>'Kopie zapasowe wpisów są włączone','since %s'=>'od %s','No Thanks'=>'Nie, dziękuję','Are you sure?'=>'Czy na pewno?','Disable Entry Backups'=>'Wyłącz kopie zapasowe wpisów','Upgrade to WPForms Pro & Restore Form Entries'=>'Kup WPForms Pro i przywróć wpisy formularzy','Entries are available through email notifications. If you enable Entry Backups, you can restore them once you upgrade to WPForms Pro.'=>'Wpisy są dostępne za pośrednictwem powiadomień e-mail. Jeśli włączysz kopie zapasowe wpisów, zyskasz możliwość ich przywracania po kupieniu WPForms Pro.','If you disable Lite Connect, you will no longer be able to restore your entries when you upgrade to WPForms Pro.'=>'Jeśli wyłączysz funkcję Lite Connect, utracisz możliwość przywracania wpisów po kupieniu WPForms Pro.','%d entry has been backed up'=>'Utworzono kopię zapasową %d wpisu' . "\0" . 'Utworzono kopię zapasową %d wpisów' . "\0" . 'Utworzono kopię zapasową %d wpisów','Last %d day'=>'Ostatni %d dzień' . "\0" . 'Ostatnie %d dni' . "\0" . 'Ostatnie %d dnia','%d entry backed up'=>'Utworzono kopię zapasową %d wpisu' . "\0" . 'Utworzono kopię zapasową %d wpisów' . "\0" . 'Utworzono kopię zapasową %d wpisu','Connecting...'=>'Łączenie...','Get WPForms Pro'=>'Uzyskaj WPForms Pro','Read the documentation'=>'Zapoznaj się z dokumentacją','One More Thing'=>'Jeszcze jedno','Form Entry Backups Are Enabled'=>'Kopie zapasowe wpisów formularza są włączone','Restore Form Entries'=>'Przywróć wpisy formularza','Form Entry Backups'=>'Kopie zapasowe wpisów formularza','Security and Protection.'=>'Zabezpieczenia i ochrona.','Security and Protection'=>'Zabezpieczenia i ochrona','Backup and Restore.'=>'Kopia zapasowa i przywracanie.','Backup and Restore'=>'Kopia zapasowa i przywracanie','WPForms Newsletter.'=>'Biuletyn WPForms.','WPForms Newsletter'=>'Biuletyn WPForms','Ready to grow your website? Get the latest pro tips and updates from the WPForms team.'=>'Chcesz rozwijać swoją witrynę? Otrzymuj najnowsze specjalistyczne porady i aktualności od zespołu WPForms.','By enabling Lite Connect you agree to our <a href="%s" target="_blank" rel="noopener noreferrer">Terms of Service</a> and to share your information with WPForms.'=>'Włączając Lite Connect, zgadzasz się na nasze <a href="%s" target="_blank" rel="noopener noreferrer">Warunki korzystania z usługi</a> i udostępnianie swoich informacji wtyczce WPForms.','WPForms now offers offsite backups for your form entries. If you decide to upgrade to WPForms Pro, you can restore entries collected while you used WPForms Lite.'=>'Obecnie wtyczka WPForms umożliwia tworzenie zewnętrznych kopii zapasowych wpisów formularza. Jeśli zdecydujesz się kupić WPForms Pro, zyskasz możliwość przywracania wpisów zebranych podczas korzystania z WPForms Lite.','Easily restore your entries when you upgrade to WPForms Pro.'=>'Łatwo przywracaj wpisy dzięki kupieniu WPForms Pro.','If your email notifications aren\'t delivered, you’ll lose form entries. Turn on free backups now and restore your entries when you upgrade to Pro.'=>'W przypadku niedostarczenia powiadomień e-mail utracisz wpisy formularza. Włącz bezpłatne kopie zapasowe już teraz i przywracaj wpisy dzięki kupieniu Pro.','Entries are stored securely and privately until you\'re ready to upgrade. Our team cannot view your forms or entries.'=>'Wpisy są bezpiecznie przechowywane z zachowaniem poufności do czasu, aż zdecydujesz się ulepszyć plan. Nasz zespół nie ma wglądu w twoje formularze ani wpisy.','When you upgrade to WPForms Pro, we\'ll automatically restore all of the entries that you collected in WPForms Lite.'=>'Kiedy kupisz WPForms Pro, automatycznie przywrócimy wszystkie wpisy zebrane w WPForms Lite.','Revisions are enabled, but they’re limited to %d. You can increase this by making a simple change to your WordPress configuration.'=>'Wersje są włączone, ale ich liczba jest ograniczona do %d. Możesz zwiększyć limit przez wprowadzenie prostej zmiany w konfiguracji WordPressa.','The WPForms plugin is disabled because it requires WordPress %s or later.'=>'Wtyczka WPForms została wyłączona, ponieważ wymaga WordPressa w wersji %s lub nowszej.','Empty Trash'=>'Opróżnij kosz','%s ago'=>'%s temu','%1$s at %2$s'=>'%1$s o %2$s','You’re about to save a form revision. Continuing will make this the current version.'=>'Zamierzasz zapisać wersję formularza. Kontynuowanie spowoduje, że stanie się ona wersją bieżącą.','Constant Contact'=>'Constant Contact','You\'ve Already Started - Here\'s the Next Step (It\'s Easy)'=>'Początek masz już za sobą – oto kolejny krok (łatwy!)','Here\'s how it works.'=>'Oto jak to wygląda.','Back to All Forms'=>'Powrót do wszystkich formularzy','Current Version'=>'Obecna wersja','by %s'=>'autor: %s','Unknown user'=>'Nieznany użytkownik','Form Revisions Are Disabled'=>'Wersje formularza są wyłączone','It appears that revisions are disabled on your WordPress installation. You can enable revisions for WPForms while leaving posts revisions disabled.'=>'Wygląda na to, że w twojej instalacji WordPressa wersje są wyłączone. Możesz włączyć wersje dla wtyczki WPForms, pozostawiając wyłączone wersje wpisów.','Learn How'=>'Poznaj sposób','Form Revisions Are Limited'=>'Wersje formularza są ograniczone','Found <strong>%1$d form</strong> in <em>the trash</em> containing <em>"%2$s"</em>'=>'Znaleziono w <em>koszu</em> <strong>%1$d formularz</strong> zawierający frazę <em>„%2$s”</em>' . "\0" . 'Znaleziono w <em>koszu</em> <strong>%1$d formularze</strong> zawierające frazę <em>„%2$s”</em>' . "\0" . 'Znaleziono w <em>koszu</em> <strong>%1$d formularzy</strong> zawierających frazę <em>„%2$s”</em>','Are you sure you want to delete the selected forms and all their entries?'=>'Czy na pewno chcesz usunąć wybrane formularze i wszystkie ich wpisy?','Are you sure you want to delete ALL the forms in the trash and all their entries?'=>'Czy na pewno chcesz usunąć WSZYSTKIE formularze znajdujące się w koszu i wszystkie ich wpisy?','Success'=>'Sukces','You can\'t edit this form because it\'s in the trash.'=>'Nie można edytować tego formularza, ponieważ jest on w koszu.','Revisions'=>'Wersje','Form Revisions'=>'Wersje formularza','Select a revision to roll back to that version. All changes, including settings, will be reverted.'=>'Wybierz wersję, do której chcesz się cofnąć. Wszystkie zmiany, w tym dotyczące ustawień, zostaną cofnięte.','Restore this revision'=>'Przywróć tę wersję','go back to the current version'=>'wróć do obecnej wersji','You’re currently viewing a form revision from %1$s at %2$s. %3$s or %4$s.'=>'Obecnie widzisz wersję z %1$s o %2$s. %3$s lub %4$s.','Restore'=>'Przywróć','Delete Permanently'=>'Usuń nieodwracalnie','Trash'=>'Przenieś do kosza','All'=>'Wszystko','Move this form to trash'=>'Przenieś ten formularz do kosza','Restore this form'=>'Przywróć ten formularz','Delete this form permanently'=>'Nieodwracalnie usuń ten formularz','Thank you for considering upgrading. If you have any questions, please <a href="%s" target="_blank" rel="noopener noreferrer">let us know</a>.'=>'Dziękujemy za rozważenie ulepszenia. W razie pytań <a href="%s" target="_blank" rel="noopener noreferrer">skontaktuj się z nami</a>.','After upgrading, your license key will remain the same.<br>You may need to do a quick refresh to unlock your new addons. In your WordPress admin, go to <strong>WPForms &raquo; Settings</strong>. If you don\'t see your updated plan, click <em>refresh</em>.'=>'Po ulepszeniu twój klucz licencyjny się nie zmieni.<br>Może być wymagane szybkie odświeżenie w celu uzyskania dostępu do nowych dodatków. W panelu administracyjnym WordPressa wybierz <strong>WPForms &raquo; Ustawienia</strong>. Jeśli zaktualizowany plan nie będzie widoczny, kliknij <em>odśwież</em>.','It looks like the form you are trying to access is no longer available.'=>'Wygląda na to, że formularz, do którego próbujesz uzyskać dostęp, już nie jest dostępny.','%d form was successfully moved to Trash.'=>'Przeniesiono %d formularz do kosza.' . "\0" . 'Przeniesiono %d formularze do kosza.' . "\0" . 'Przeniesiono %d formularzy do kosza.','%d form was successfully permanently deleted.'=>'Nieodwracalnie usunięto %d formularz.' . "\0" . 'Nieodwracalnie usunięto %d formularze.' . "\0" . 'Nieodwracalnie usunięto %d formularzy.','The best WordPress eCommerce plugin for selling digital downloads. Start selling eBooks, software, music, digital art, and more within minutes. Accept payments, manage subscriptions, advanced access control, and more.'=>'Najlepsza wtyczka e-handlu do WordPressa, służąca do sprzedawania pobieranych treści cyfrowych. Zacznij sprzedawać e-booki, oprogramowanie, muzykę, sztukę cyfrową i inne treści w ciągu minut. Możesz przyjmować płatności, zarządzać subskrypcjami, szczegółowo kontrolować dostęp i nie tylko.','Sugar Calendar'=>'Sugar Calendar','A simple & powerful event calendar plugin for WordPress that comes with all the event management features including payments, scheduling, timezones, ticketing, recurring events, and more.'=>'Prosta i wydajna wtyczka kalendarza do WordPressa, która zawiera wszystkie potrzebne funkcje zarządzania wydarzeniami, w tym płatności, harmonogram, strefy czasowe, bilety, wydarzenia cykliczne i nie tylko.','Sugar Calendar Pro'=>'Sugar Calendar Pro','Author'=>'Autor','Search Forms'=>'Wyszukaj formularze','#%d (no title)'=>'#%d (brak tytułu)','Theme starter contentCreate your <a href="%s" target="_blank" rel="noopener noreferrer">contact form</a> with WPForms in minutes.'=>'Utwórz <a href="%s" target="_blank" rel="noopener noreferrer">formularz kontaktowy</a> w kilka minut przy użyciu wtyczki WPForms.','Clear search and return to All Forms'=>'Wyczyść wyszukiwanie i wróć do wszystkich formularzy','Below is the total number of submissions for each form, however actual entries are not stored in WPForms Lite.'=>'Poniżej pokazano łączną liczbę przesłań każdego formularza, jednak same wpisy nie są przechowywane w WPForms Lite.','0 items'=>'0 pozycji','To view future entries inside your WordPress dashboard, and get more detailed reports, consider upgrading to Pro:'=>'Aby przeglądać przyszłe wpisy w kokpicie WordPressa i mieć dostęp do bardziej szczegółowych raportów, rozważ kupienie Pro:','Found <strong>%1$d form</strong> containing <em>"%2$s"</em>'=>'Znaleziono <strong>%1$d formularz</strong> zawierający frazę <em>„%2$s”</em>' . "\0" . 'Znaleziono <strong>%1$d formularze</strong> zawierające frazę <em>„%2$s”</em>' . "\0" . 'Znaleziono <strong>%1$d formularzy</strong> zawierających frazę <em>„%2$s”</em>','Store and manage form entries in WordPress'=>'Przechowywanie wpisów formularzy i zarządzanie nimi w WordPressie','Collect signatures, geolocation data, and file uploads'=>'Zbieranie podpisów, danych geolokalizacyjnych i przesłanych plików','SearchWP'=>'SearchWP','The most advanced WordPress search plugin. Customize your WordPress search algorithm, reorder search results, track search metrics, and everything you need to leverage search to grow your business.'=>'Najbardziej zaawansowana wtyczka wyszukiwania do WordPressa. Umożliwia dostosowywanie algorytmu wyszukiwania w WordPressie, zmianę kolejności wyników wyszukiwania i śledzenie wskaźników wyszukiwania oraz udostępnia wszystkie funkcje potrzebne do rozwijania działalności przy użyciu wyszukiwarki.','AffiliateWP'=>'AffiliateWP','The #1 affiliate management plugin for WordPress. Easily create an affiliate program for your eCommerce store or membership site within minutes and start growing your sales with the power of referral marketing.'=>'Najlepsza wtyczka do WordPressa służąca do zarządzania partnerami. Łatwo utwórz program partnerski do swojego sklepu internetowego lub witryny członkowskiej w czasie rzędu minut i zacznij powiększać sprzedaż dzięki potędze marketingu rekomendacji.','WP Simple Pay'=>'WP Simple Pay','The #1 Stripe payments plugin for WordPress. Start accepting one-time and recurring payments on your WordPress site without setting up a shopping cart. No code required.'=>'Najlepsza wtyczka do WordPressa umożliwiająca obsługę płatności Stripe. Zacznij przyjmować płatności jednorazowe i cykliczne w swojej witrynie w WordPressie, nie zakładając koszyka. Nie musisz pisać żadnego kodu.','WP Simple Pay Pro'=>'WP Simple P