 and install it manually.'=>'Nie udało się zainstalować wtyczki. Pobierz ją i zainstaluj ręcznie.','Easily display Facebook content on your WordPress site without writing any code. Comes with multiple templates, ability to embed albums, group content, reviews, live videos, comments, and reactions.'=>'Łatwo wyświetlaj treści z Facebooka w swojej witrynie w WordPressie, nie pisząc żadnego kodu. Zawiera wiele szablonów, możliwość osadzania albumów, obsługę treści z grup, oceny, filmy na żywo, komentarze i reakcje.','Smash Balloon Facebook Feeds Pro'=>'Smash Balloon Facebook Feeds Pro','Smash Balloon YouTube Feeds'=>'Smash Balloon YouTube Feeds','Easily display YouTube videos on your WordPress site without writing any code. Comes with multiple layouts, ability to embed live streams, video filtering, ability to combine multiple channel videos, and more.'=>'Łatwo wyświetlaj filmy z YouTube w swojej witrynie w WordPressie, nie pisząc żadnego kodu. Zawiera wiele układów, możliwość osadzania transmisji strumieniowych na żywo, filtrowanie filmów, możliwość łączenia filmów z różnych kanałów i inne funkcje.','Smash Balloon YouTube Feeds Pro'=>'Smash Balloon YouTube Feeds Pro','Smash Balloon Twitter Feeds'=>'Smash Balloon Twitter Feeds','Easily display Twitter content in WordPress without writing any code. Comes with multiple layouts, ability to combine multiple Twitter feeds, Twitter card support, tweet moderation, and more.'=>'Łatwo wyświetlaj treści z Twittera w swojej witrynie w WordPressie, nie pisząc żadnego kodu. Zawiera wiele układów, możliwość łączenia różnych kanałów Twittera, obsługę kart Twittera, moderację tweetów i inne funkcje.','Smash Balloon Twitter Feeds Pro'=>'Smash Balloon Twitter Feeds Pro','TrustPulse'=>'TrustPulse','Boost your sales and conversions by up to 15% with real-time social proof notifications. TrustPulse helps you show live user activity and purchases to help convince other users to purchase.'=>'Zwiększ sprzedaż i konwersje nawet o 15% dzięki prz