oogle Analytics bez pisania kodu.','Improve your WordPress email deliverability and make sure that your website emails reach user\'s inbox with the #1 SMTP plugin for WordPress. Over 3 million websites use it to fix WordPress email issues.'=>'Najlepsza wtyczka SMTP do WordPressa, za pomocą której można zwiększyć skuteczność dostarczania e-maili z witryny internetowej do skrzynek użytkowników. Dzięki niej ponad 3 miliony witryn rozwiązuje problemy z e-mailami w WordPressie.','AIOSEO'=>'AIOSEO','The original WordPress SEO plugin and toolkit that improves your website\'s search rankings. Comes with all the SEO features like Local SEO, WooCommerce SEO, sitemaps, SEO optimizer, schema, and more.'=>'Oryginalna wtyczka i zestaw narzędzi SEO do WordPressa, które poprawiają pozycję witryny w wynikach wyszukiwania. Zawiera wszystkie potrzebne funkcje pozycjonowania, takie jak SEO lokalne, SEO dla WooCommerce, mapy witryn, optymalizator SEO, schemat itd.','AIOSEO Pro'=>'AIOSEO Pro','The fastest drag & drop landing page builder for WordPress. Create custom landing pages without writing code, connect them with your CRM, collect subscribers, and grow your audience. Trusted by 1 million sites.'=>'Najszybszy kreator stron docelowych do WordPressa oparty na technice przeciągania elementów. Twórz własne strony docelowe bez pisania kodu, łącz je ze swoim systemem CRM, zdobywaj subskrybentów i powiększaj grono odbiorców. Narzędzie używane w milionie witryn.','SeedProd Pro'=>'SeedProd Pro','Turn your website visitors into brand ambassadors! Easily grow your email list, website traffic, and social media followers with the most powerful giveaways & contests plugin for WordPress.'=>'Zmień osoby odwiedzające twoją witrynę internetową w ambasadorów marki! Łatwo powiększaj listę adresów e-mail, ruch w witrynie oraz grono obserwujących w mediach społecznościowych przy użyciu najwydajniejszej wtyczki losowań i konkursów do WordPressa.','PushEngage'=>'PushEngage','Connect with your visitors after they leave your website with the leading web push notification software. Over 10,000+ businesses worldwide use PushEngage to send 15 billion notifications each month.'=>'Kontaktuj się z gośćmi, którzy opuścili twoją witrynę, korzystając z czołowej wtyczki do internetowych powiadomień push. Ponad 10 000 firm na całym świecie korzysta z PushEngage, wysyłając każdego miesiąca 15 miliardów powiadomień.','Smash Balloon Instagram Feeds'=>'Smash Balloon Instagram Feeds','Easily display Instagram content on your WordPress site without writing any code. Comes with multiple templates, ability to show content from multiple accounts, hashtags, and more. Trusted by 1 million websites.'=>'Łatwo wyświetlaj treści z Instagrama w swojej witrynie w WordPressie, nie pisząc żadnego kodu. Zawiera wiele szablonów, możliwość wyświetlania treści z wielu kont, hashtagi i inne funkcje. Narzędzie używane w ponad milionie witryn.','Smash Balloon Instagram Feeds Pro'=>'Smash Balloon Instagram Feeds Pro','Smash Balloon Facebook Feeds'=>'Smash Balloon Facebook Feeds','Instantly get more subscribers, leads, and sales with the #1 conversion optimization toolkit. Create high converting popups, announcement bars, spin a wheel, and more with smart targeting and personalization.'=>'Najlepszy zestaw narzędzi do optymalizacji konwersji, dzięki któremu możesz błyskawicznie zwiększyć liczbę subskrybentów i potencjalnych klientów oraz wielkość sprzedaży. Twórz skuteczne okna pop-up, paski ogłoszeń, „koła fortuny” oraz inne elementy z inteligentnymi funkcjami targetowania i personalizacji.','Do you want to learn more about visitors who fill out your online forms? Our geolocation addon allows you to collect and store your website visitors geolocation data along with their form submission. This insight can help you to be better informed and turn more leads into customers. Furthermore, add a smart address field that autocompletes using the Google Places API.'=>'Czy chcesz wiedzieć więcej o osobach, które podczas wizyty w twojej witrynie wypełniają formularze online? Nasz dodatek geolokalizacyjny sprawia, że oprócz przesłanych formularzy możesz także zbierać i zapisywać dane geolokalizacyjne na temat gości witryny. Przekłada się to na bogatszą wiedzę i skuteczniejsze przekształcanie potencjalnych klientów w rzeczywistych. Ponadto możesz dodać inteligentne pole adresu, które będzie uzupełniane automatycznie przy użyciu interfejsu Google Places API.','Location Info in Entries'=>'Dane lokalizacyjne we wpisach','Address Autocomplete Field'=>'Pole autouzupełniania adresu','Smart Address Field'=>'Inteligentne pole adresu','Latitude/Longitude'=>'Szerokość/długość geograficzna','Install & Activate'=>'Zainstaluj i włącz','Bonaire, Saint Eustatius and Saba'=>'Holandia Karaibska','To edit the License Key, please first click the Remove Key button. Please note that removing this key will remove access to updates, addons, and support.'=>'Aby edytować klucz licencyjny, najpierw kliknij przycisk Usuń klucz. Zwróć uwagę, że usunięcie tego klucza spowoduje utratę dostępu do aktualizacji, dodatków i pomocy technicznej.','It seems you don\'t have any payment addons activated. Click one of the available addons and start accepting payments today!'=>'Wygląda na to, że nie masz włączonych dodatków płatniczych. Kliknij jeden z dostępnych dodatków i już dziś zacznij przyjmować płatności.','Number Positive'=>'Liczba dodatnia','Survey Results'=>'Wyniki ankiety','Form ID: %d'=>'Identyfikator formularza: %d','Locations'=>'Lokalizacje','This setting is disabled because you have the "Force From Name" setting enabled in the <a href="%s" target="_blank">WP Mail SMTP</a> plugin.'=>'To ustawienie jest wyłączone, ponieważ we wtyczce <a href="%s" target="_blank">WP Mail SMTP</a> jest włączone ustawienie „Force From Name” (Wymuś imię i nazwisko nadawcy).','This setting is disabled because you have the "Force From Email" setting enabled in the <a href="%s" target="_blank">WP Mail SMTP</a> plugin.'=>'To ustawienie jest wyłączone, ponieważ we wtyczce <a href="%s" target="_blank">WP Mail SMTP</a> jest włączone ustawienie „Force From Email” (Wymuś adres e-mail nadawcy).','N/A'=>'Nd.','No Label'=>'Brak etykiety','City'=>'Miejscowość','Country'=>'Kraj','Postal/Zip Code'=>'Kod pocztowy','Embedded Map in Forms'=>'Osadzona mapa w formularzach','Google Places API'=>'Google Places API','Powerful location-based insights and features…'=>'Zaawansowane informacje i funkcje związane z lokalizacją…','You are not allowed to install plugins.'=>'Nie posiadasz uprawnień do instalowania wtyczek.','Address Autocomplete'=>'Autouzupełnianie adresu','Enable Address Autocomplete'=>'Włącz autouzupełnianie adresu','We\'re sorry, Address Autocomplete is part of the Geolocation Addon and not available on your plan. Please upgrade to the PRO plan to unlock all these awesome features.'=>'Niestety, autouzupełnianie adresu jest elementem dodatku Geolokalizacja, który nie wchodzi w skład twojego planu. Kup PRO, aby uzyskać dostęp do tej i innych fantastycznych funkcji.','WPForms Pro is installed but not activated.'=>'Wtyczka WPForms Pro jest zainstalowana, ale nie została włączona.','There was an error while installing an upgrade. Please download the plugin from wpforms.com and install it manually.'=>'Podczas instalowania ulepszenia wystąpił błąd. Pobierz wtyczkę ze strony wpforms.com i zainstaluj ją ręcznie.','Heads up! WPForms has detected an issue with JavaScript on this page. JavaScript is required for this form to work properly, so this form may not work as expected. See our <a href="%s" target="_blank" rel="noopener noreferrer">troubleshooting guide</a> to learn more or contact support.'=>'Uwaga! Wtyczka WPForms wykryła na tej stronie problem z językiem JavaScript. JavaScript jest wymagany do prawidłowego działania tego formularza, więc formularz może nie działać zgodnie z oczekiwaniami. Zapoznaj się z <a href="%s" target="_blank" rel="noopener noreferrer">przewodnikiem po rozwiązywaniu problemów</a>, aby uzyskać więcej informacji, lub skontaktuj się z zespołem pomocy technicznej.','This message is only displayed to site administrators.'=>'Ten komunikat jest wyświetlany tylko administratorowi witryny.','The form was unable to submit. Please contact the site administrator.'=>'Nie udało się przesłać formularza. Skontaktuj się z administratorem witryny.','A preview of your CAPTCHA is displayed below. Please view to verify the CAPTCHA settings are correct.'=>'Poniżej wyświetlono podgląd testu CAPTCHA. Obejrzyj go i sprawdź, czy ustawienia CAPTCHA są poprawne.','Please save settings to generate a preview of your CAPTCHA here.'=>'Zapisz ustawienia, aby wygenerować tutaj podgląd testu CAPTCHA.','This CAPTCHA is generated using your site and secret keys. If an error is displayed, please double-check your keys.'=>'Ten test CAPTCHA jest generowany przy użyciu twojej witryny i kluczy tajnych. W przypadku wyświetlenia błędu dokładnie sprawdź swoje klucze.','Missing data.'=>'Brakujące dane.','CAPTCHA'=>'CAPTCHA','Custom Captcha'=>'Własny test Captcha','Are you sure you want to disable %s for this form?'=>'Czy na pewno chcesz wyłączyć funkcję %s w tym formularzu?','hCaptcha verification failed, please try again later.'=>'Weryfikacja hCaptcha nie powiodła się. Spróbuj ponownie później.','Copy embed code to clipboard'=>'Skopiuj kod osadzania do schowka','For more details on how hCaptcha works, as well as a step by step setup guide, please check out our <a href="%s" target="_blank" rel="noopener noreferrer">documentation</a>.'=>'Aby uzyskać więcej informacji na temat sposobu działania usługi hCaptcha i zapoznać się ze szczegółowym przewodnikiem, zajrzyj do naszej <a href="%s" target="_blank" rel="noopener noreferrer">dokumentacji</a>.','hCaptcha is a free and privacy-oriented spam prevention service. Within your forms, hCaptcha will display a checkbox asking users to prove they\'re human (much like Google\'s v2 Checkbox reCAPTCHA). This is a simple step for legitimate site visitors, but is extremely effective at blocking spam.'=>'hCaptcha to bezpłatna, ukierunkowana na ochronę prywatności usługa zapobiegania spamowi. W ramach formularza hCaptcha wyświetla pole wyboru, prosząc użytkownika o potwierdzenie, że jest człowiekiem (podobnie jak Google v2 Checkbox reCAPTCHA). Jest to prosta czynność dla rzeczywistych gości witryny i wyjątkowo skuteczny sposób na blokowanie spamu.','Your session expired. Please reload the page.'=>'Sesja wygasła. Wczytaj stronę ponownie.','Connection missing.'=>'Brak połączenia.','Kosovo'=>'Kosowo','Character Limit'=>'Limit znaków','Disabling entry storage for this form will completely prevent any new submissions from getting saved to your site. If you still intend to keep a record of entries through notification emails, then please <a href="%s" target="_blank" rel="noopener noreferrer">test your form</a> to ensure emails send reliably.'=>'Wyłączenie przechowywania wpisów dla tego formularza spowoduje, że żadne nowo przesłane formularze nie będą zapisywane w twojej witrynie. Jeśli nadal zamierzasz prowadzić rejestr wpisów za pośrednictwem powiadomień e-mail, <a href="%s" target="_blank" rel="noopener noreferrer">przetestuj formularz</a>, aby sprawdzić niezawodność wysyłania e-maili.','Word Limit'=>'Limit słów','Google reCAPTCHA v2'=>'Google reCAPTCHA v2','%s verification failed, please try again later.'=>'Weryfikacja %s nie powiodła się. Spróbuj ponownie później.','Eswatini (Kingdom of)'=>'Eswatini (Królestwo)','Vietnam'=>'Wietnam','Enable hCaptcha'=>'Włącz funkcję hCaptcha','Could not disconnect this account.'=>'Nie udało się odłączyć tego konta.','For details, including how this looks and works for your site\'s visitors, please check out <a href="%s" target="_blank" rel="noopener noreferrer">our doc</a>.'=>'Szczegółowe informacje, w tym dotyczące wyglądu i sposobu działania u osób odwiedzających witrynę, można znaleźć w <a href="%s" target="_blank" rel="noopener noreferrer">dokumentacji</a>.','Search results for "%s"'=>'Wyniki wyszukiwania dla „%s”','Payment'=>'Płatność','Log'=>'Dziennik','Styling'=>'Stylizacja','Functionality'=>'Funkcjonalność','Providers'=>'Usługodawcy','Errors'=>'Błędy','Users'=>'Użytkownicy','Log ID'=>'Identyfikator dziennika','Apply'=>'Zastosuj','Clear'=>'Wyczyść','Writable'=>'Zapisywalne','Not writable'=>'Brak uprawnień do zapisu','Help'=>'Pomoc','Your session expired. Please reload the builder.'=>'Sesja wygasła. Wczytaj kreator ponownie.','Something went wrong while performing this action.'=>'Podczas wykonywania tego działania coś poszło nie tak.','Something went wrong while saving the form.'=>'Podczas zapisywania formularza coś poszło nie tak.','Something went wrong while saving the form. Please reload the page and try again.'=>'Podczas zapisywania formularza coś poszło nie tak. Wczytaj ponownie stronę i spróbuj jeszcze raz.','Please contact the plugin support team if this behavior persists.'=>'Jeśli to zachowanie nie ustąpi, skontaktuj się z zespołem pomocy technicznej obsługującym wtyczkę.','Docs'=>'Dokumenty','Email Restricted'=>'Adres e-mail objęty ograniczeniem','This email address is not allowed.'=>'Ten adres e-mail jest niedozwolony.','Allowlist / Denylist'=>'Lista dozwolonych / lista niedozwolonych','Restrict which email addresses are allowed. Be sure to separate each email address with a comma.'=>'Ogranicz dozwolone adresy e-mail. Każdy wpisywany adres e-mail oddziel przecinkiem.','Allowlist'=>'Lista dozwolonych','Denylist'=>'Lista niedozwolonych','Extending'=>'Rozszerzanie','Uploads directory'=>'Katalog przesłanych plików','Enable Logs'=>'Włącz dzienniki','Log Types'=>'Rodzaje dzienników','Select the types of events you want to log. Everything is logged by default.'=>'Wybierz rodzaje zdarzeń do rejestrowania. Domyślnie są rejestrowane wszystkie zdarzenia.','Select the user roles you want to log. All roles are logged by default.'=>'Wybierz role użytkowników do rejestrowania. Domyślnie są rejestrowane wszystkie role.','Log events for specific users only. All users are logged by default.'=>'Rejestruj zdarzenia dotyczące tylko określonych użytkowników. Domyślnie są rejestrowani wszyscy użytkownicy.','Select form'=>'Wybierz formularz','Log Title'=>'Tytuł dziennika','Types'=>'Rodzaje','View Logs'=>'Zobacz dzienniki','Search Logs'=>'Wyszukaj dzienniki','Delete All Logs'=>'Usuń wszystkie dzienniki','No logs found.'=>'Nie znaleziono dzienników.','All Logs'=>'Wszystkie dzienniki','Spam'=>'Spam','--- Select Form Field ---'=>'--- Wybierz pole formularza ---','Ask a question or search the docs...'=>'Zadaj pytanie lub przeszukaj dokumenty...','No docs found'=>'Nie znaleziono dokumentów','View Documentation'=>'Zobacz dokumentację','Browse documentation, reference material, and tutorials for WPForms.'=>'Przejrzyj dokumentację, materiały pomocnicze i poradniki dotyczące wtyczki WPForms.','View All Documentation'=>'Zobacz całą dokumentację','Get Support'=>'Uzyskaj pomoc','Submit a ticket and our world class support team will be in touch soon.'=>'Prześlij zgłoszenie, a nasz światowej klasy zespół pomocy technicznej wkrótce się z Tobą skontaktuje.','Submit a Support Ticket'=>'Prześlij zgłoszenie','View All'=>'Zobacz wszystko','Unfortunately the error occurred while downloading help data.'=>'Niestety podczas pobierania danych pomocy wystąpił błąd.','You are not allowed to perform this action.'=>'Brak uprawnienia do wykonania tego działania.','Upgrade to WPForms Pro to access our world class customer support.'=>'Kup WPForms Pro, aby uzyskać dostęp do naszej światowej klasy obsługi klienta.','Enable and configure the logging functionality while debugging behavior of various parts of the plugin, including form and entry processing.'=>'Włącz i skonfiguruj funkcję rejestrowania stosowaną podczas rozwiązywania problemów z działaniem różnych części wtyczki, w tym z przetwarzaniem formularzy i wpisów.','User Roles'=>'Role użytkownika','WordPress.org'=>'WordPress.org','Plugin deactivation is disabled for you on this site.'=>'W tej witrynie funkcja wyłączania wtyczki jest wyłączona.','Plugin activation is disabled for you on this site.'=>'W tej witrynie funkcja włączania wtyczki jest wyłączona.','There was an error while performing your request.'=>'Podczas wykonywania żądania wystąpił błąd.','Take your pick from our wide variety of fields and start building out your form!'=>'Wybierz jedno z wielu dostępnych pól i zacznij tworzyć własny formularz.','Increment value should be greater than zero. Decimal fractions allowed.'=>'Wartość przyrostu powinna być większa od zera. Dozwolone są ułamki dziesiętne.','MonsterInsights on WordPress.org'=>'MonsterInsights na WordPress.org','WP Mail SMTP on WordPress.org'=>'WP Mail SMTP na WordPress.org','It looks like you haven’t created any forms yet.'=>'Chyba jeszcze nie masz samodzielnie utworzonych formularzy.','We can help embed your form with just a few clicks!'=>'Możemy ci pomóc w osadzeniu formularza za pomocą kilku kliknięć!','Select the page you would like to embed your form in.'=>'Wybierz stronę, na której chcesz osadzić formularz.','What would you like to call the new page?'=>'Jaką nazwę chcesz nadać nowej stronie?','You can also <a href="#" class="%1$s">embed your form manually</a> or <a href="#" class="%2$s">use a shortcode</a>'=>'Możesz także <a href="#" class="%1$s">osadzić formularz ręcznie</a> lub <a href="#" class="%2$s">użyć krótkiego kodu</a>','This email was auto-generated and sent from %s.'=>'Ten e-mail został wygenerowany automatycznie i wysłany z witryny %s.','Learn how to disable: %s.'=>'Dowiedz się, jak to wyłączyć: %s.','This email was auto-generated and sent from %1$s. Learn <a href="%2$s">how to disable</a>.'=>'Ten e-mail został wygenerowany automatycznie i wysłany z witryny %1$s. Dowiedz się, <a href="%2$s">jak to wyłączyć</a>.','New form'=>'Nowy formularz','Select a form'=>'Wybierz formularz','Display Options'=>'Opcje wyświetlania','Save and Embed'=>'Zapisz i osadź','Your form contains unsaved changes. Would you like to save your changes first.'=>'Formularz zawiera niezapisane zmiany. Czy chcesz najpierw zapisać zmiany?','Add Custom Value'=>'Dodaj wartość własną','%1$s These messages are displayed to the users as they fill out a form in real-time. Messages can include plain text and/or %2$sSmart Tags%3$s.'=>'%1$s Te komunikaty są wyświetlane w czasie rzeczywistym, kiedy użytkownik wypełnia formularz. Komunikaty mogą zawierać zwykły tekst i/lub %2$stagi inteligentne%3$s.','Input Mask Incomplete'=>'Niepełna maska wprowadzania','Enable anti-spam protection'=>'Włącz ochronę antyspamową','This page isn\'t loading JavaScript properly, and the form will not be able to submit.'=>'Ta strona nie wczytuje prawidłowo kodu JavaScript i przesłanie formularza będzie niemożliwe.','Form token is invalid. Please refresh the page.'=>'Token formularza jest nieprawidłowy. Odśwież stronę.','Please check out our %1$stroubleshooting guide%2$s for details on resolving this issue.'=>'Aby uzyskać szczegółowe informacje o rozwiązywaniu tego problemu, zajrzyj do naszego %1$sprzewodnika po rozwiązywaniu problemów%2$s.','<b>You haven\'t created a form yet.</b><br> What are you waiting for?'=>'<b>Jeszcze nie masz utworzonych formularzy.</b><br> Na co czekasz?','Need to make changes? <a href="#">Edit the selected form.</a>'=>'Chcesz wprowadzić zmiany? <a href="#">Edytuj wybrany formularz.</a>','<b>Heads up!</b> Don\'t forget to test your form. <a href="%s" target="_blank" rel="noopener noreferrer">Check out our complete guide!</a>'=>'<b>Uwaga!</b> Nie zapomnij przetestować formularza. <a href="%s" target="_blank" rel="noopener noreferrer">Zapoznaj się ze szczegółowym przewodnikiem!</a>','Please fill out all blanks.'=>'Uzupełnij wszystkie puste pola.','Forcefully remove other CAPTCHA occurrences in order to prevent conflicts. Only enable this option if your site is having compatibility issues or instructed by support.'=>'Wymuś usunięcie innych wystąpień testu CAPTCHA, aby zapobiec konfliktom. Włączaj tę opcję tylko wtedy, gdy w witrynie występują problemy ze zgodnością, lub na prośbę kogoś z zespołu pomocy technicznej.','Choice %d'=>'Wybór %d','Need some help? Check out our <a href="%s" target="_blank" rel="noopener noreferrer">comprehensive guide</a>.'=>'Potrzebujesz pomocy? Zapoznaj się z naszym <a href="%s" target="_blank" rel="noopener noreferrer">obszernym przewodnikiem</a>.','You can use <b>WPForms</b> to build contact forms, surveys, payment forms, and more with just a few clicks.'=>'Korzystając z wtyczki <b>WPForms</b>, możesz przy użyciu kilku kliknięć tworzyć formularze kontaktowe, ankiety, formularze płatności i nie tylko.','Displays to users who fail the verification process.'=>'Wyświetlany użytkownikom, którzy nie przejdą procesu weryfikacji.','Continue'=>'Kontynuuj','You can add additional fields to your form, if you need them.'=>'W razie potrzeby możesz wstawić do formularza dodatkowe pola.','Welcome to the Form Builder'=>'Witamy w kreatorze formularzy','Our form builder is a full-screen, distraction-free experience where you manage your forms. The following steps will walk you through essential areas.'=>'Nasz kreator formularzy to pełnoekranowe środowisko bez zbędnych elementów, które służy do zarządzania formularzami. Dzięki poniższym krokom poznasz jego najważniejsze obszary.','Let’s Go!'=>'Do dzieła!','Toggle list'=>'Przełącz listę','Check Notifications'=>'Sprawdź powiadomienia','Challenge Complete'=>'Wyzwanie ukończone','Pause'=>'Wstrzymaj','End Challenge'=>'Zakończ wyzwanie','Would you like to embed your form in an existing page, or create a new one?'=>'Czy chcesz osadzić formularz na już istniejącej stronie czy utworzyć nową?','Select Existing Page'=>'Wybierz stronę','Name Your Page'=>'Nadaj stronie nazwę','Create New Page'=>'Utwórz nową stronę','Authorize.Net'=>'Authorize.Net','Allow Usage Tracking'=>'Zezwól na śledzenie użycia','By allowing us to track usage data, we can better help you, as we will know which WordPress configurations, themes, and plugins we should test.'=>'Jeśli zezwolisz na śledzenie danych o użyciu, będzie nam łatwiej ci pomagać, ponieważ będziemy wiedzieć, jakie konfiguracje, motywy i wtyczki do WordPressa powinniśmy testować.','Field #%d'=>'Pole nr %d','Advanced Fields'=>'Pola zaawansowane','Scheduled Actions'=>'Zaplanowane działania','File Uploads'=>'Przesyłanie plików','Only unique values can be added'=>'Można dodawać tylko unikatowe wartości','Only values matching specific conditions can be added'=>'Można dodawać tylko wartości spełniające określone warunki','Multiple Options Selection'=>'Wybór wielu opcji','Allow users to select multiple choices in this field.'=>'Umożliwia wybranie wielu opcji w tym polu.','Style'=>'Styl','Classic style is the default one generated by your browser. Modern has a fresh look and displays all selected options in a single row.'=>'Styl klasyczny to domyślny styl generowany przez przeglądarkę. Styl nowoczesny ma świeży wygląd i powoduje wyświetlanie wszystkich wybranych opcji w jednym rzędzie.','North Macedonia (Republic of)'=>'Macedonia Północna (Republika)','Are you sure you want to leave? You have unsaved changes'=>'Czy na pewno chcesz wyjść? Masz niezapisane zmiany.','In order to complete your form\'s %s integration, please check that the dropdowns for all required (*) List Fields have been filled out.'=>'Aby dokończyć integrację formularza z produktem %s, sprawdź, czy zostały uzupełnione listy rozwijane wszystkich wymaganych (*) pól listy.','Support'=>'Pomoc techniczna','Optimize Email Sending'=>'Zoptymalizuj wysyłanie e-maili','Hide Admin Bar Menu'=>'Ukryj menu na pasku administratora','Previous message'=>'Poprzednia wiadomość','Next message'=>'Następna wiadomość','Additional Marketing Integrations'=>'Dodatkowe integracje marketingowe','Pro Addons Included'=>'Dołączone dodatki Pro','is an Elite Feature'=>'to funkcja Elite','We\'re sorry, the %s is not available on your plan. Please upgrade to the Elite plan to unlock all these awesome features.'=>'Niestety, pozycja