age and customize access to WPForms functionality.'=>'Funkcja kontroli dostępu umożliwia zarządzanie dostępem do funkcji wtyczki WPForms i jego dostosowywanie.','You can easily grant or restrict access using the simple built-in controls, or use our official integrations with Members and User Role Editor plugins.'=>'Możesz używać prostych wbudowanych mechanizmów kontroli, aby łatwo przyznawać lub ograniczać dostęp, albo skorzystać z oficjalnych integracji z wtyczkami Members i User Role Editor.','Simple Built-in Controls'=>'Proste wbudowane mechanizmy kontroli','Members Integration'=>'Integracja z wtyczką Members','User Role Editor Integration'=>'Integracja z wtyczką User Role Editor','Create Forms'=>'Tworzenie formularzy','Edit Forms'=>'Edytowanie formularzy','Edit Others Forms'=>'Edytowanie formularzy innych osób','View Forms'=>'Wyświetlanie formularzy','View Others Forms'=>'Wyświetlanie formularzy innych osób','Delete Forms'=>'Usuwanie formularzy','Delete Others Forms'=>'Usuwanie formularzy innych osób','View Forms Entries'=>'Wyświetlanie wpisów formularzy','View Others Forms Entries'=>'Wyświetlanie wpisów formularzy innych osób','Edit Forms Entries'=>'Edytowanie wpisów formularzy','Edit Others Forms Entries'=>'Edytowanie wpisów formularzy innych osób','Delete Forms Entries'=>'Usuwanie wpisów formularzy','Delete Others Forms Entries'=>'Usuwanie wpisów formularzy innych osób','Custom access to the following capabilities…'=>'Własne prawa dostępu do poniższych możliwości…','You do not have permission to perform this operation.'=>'Nie masz uprawnienia do wykonania tej operacji.','Upgrade to Pro'=>'Kup Pro','Your site already has WPForms Pro activated. If you want to switch to WPForms Lite, please first go to Plugins → Installed Plugins and deactivate WPForms. Then, you can activate WPForms Lite.'=>'W twojej witrynie już jest włączona wtyczka WPForms Pro. Jeśli chcesz przejść na WPForms Lite, najpierw przejdź do obszaru Wtyczki → Zainstalowane wtyczki i wyłącz wtyczkę 