uj MonsterInsights','Activate MonsterInsights'=>'Włącz MonsterInsights','Setup Complete'=>'Konfiguracja ukończona','Plugin unavailable.'=>'Wtyczka niedostępna.','WP Mail SMTP Installed & Activated'=>'Zainstalowano i włączono wtyczkę WP Mail SMTP','Go to SMTP settings'=>'Przejdź do ustawień SMTP','WPForms ♥ WP Mail SMTP'=>'WPForms ♥ WP Mail SMTP','Making Email Deliverability Easy for WordPress'=>'Łatwe dostarczanie e-maili w WordPressie','WP Mail SMTP screenshot'=>'Zrzut ekranu wtyczki WP Mail SMTP','Set Up WP Mail SMTP'=>'Skonfiguruj wtyczkę WP Mail SMTP','Select and configure your mailer.'=>'Wybierz i skonfiguruj narzędzie pocztowe.','Install and Activate WP Mail SMTP'=>'Zainstaluj i włącz wtyczkę WP Mail SMTP','Install WP Mail SMTP from the WordPress.org plugin repository.'=>'Zainstaluj wtyczkę WP Mail SMTP z repozytorium wtyczek na stronie WordPress.org.','Install WP Mail SMTP'=>'Zainstaluj wtyczkę WP Mail SMTP','Activate WP Mail SMTP'=>'Włącz wtyczkę WP Mail SMTP','Start Setup'=>'Rozpocznij konfigurację','Download Now'=>'Pobierz','Go to Plugins page'=>'Przejdź na stronę Wtyczki','Run Setup Wizard'=>'Uruchom kreator konfiguracji','See Quick Links'=>'Zobacz szybkie odnośniki','Support & Docs'=>'Pomoc techniczna i dokumenty','Join Our Community'=>'Dołącz do naszej społeczności','PayPal Standard'=>'PayPal Standard','<strong>You\'re using WPForms Lite.</strong> To unlock more features consider <a href="%s" target="_blank" rel="noopener noreferrer">upgrading to Pro</a> for 50%% off.'=>'<strong>Korzystasz z WPForms Lite.</strong> Aby uzyskać dostęp do dodatkowych funkcji, rozważ <a href="%s" target="_blank" rel="noopener noreferrer">przejście na plan Pro</a> z 50-procentową zniżką.','Suggest a Feature'=>'Zaproponuj funkcję','Community'=>'Społeczność','Words'=>'Słowa','Limit Length'=>'Ogranicz długość','Check this option to limit text length by characters or words count.'=>'Zaznacz tę opcję, aby ograniczyć długość tekstu według liczby znaków lub słów.','Characters'=>'Znaki','WPForms VIP Circle Facebook Group'=>'Grupa WPForms VIP Circle na Facebooku','Powered by the community, for the community. Anything and everything WPForms: Discussions. Questions. Tutorials. Insights and sneak peaks. Also, exclusive giveaways!'=>'Od społeczności – dla społeczności. Wszystko, co dotyczy wtyczki WPForms: dyskusje, pytania, poradniki, spostrzeżenia i omówienia przedpremierowe. A także wyjątkowe loterie z nagrodami!','Join WPForms VIP Circle'=>'Dołącz do WPForms VIP Circle','WPForms Developer Documentation'=>'Dokumentacja WPForms dla deweloperów','Customize and extend WPForms with code. Our comprehensive developer resources include tutorials, snippets, and documentation on core actions, filters, functions, and more.'=>'Wtyczkę WPForms można dostosowywać i rozszerzać przy użyciu własnego kodu. Nasze obszerne zasoby dla deweloperów obejmują poradniki, fragmenty kodu oraz dokumentację dotyczącą najważniejszych działań, filtrów, funkcji i nie tylko.','View WPForms Dev Docs'=>'Zobacz dokumentację WPForms dla deweloperów','WPBeginner Engage Facebook Group'=>'Grupa WPBeginner Engage na Facebooku','Hang out with other WordPress experts and like minded website owners such as yourself! Hosted by WPBeginner, the largest free WordPress site for beginners.'=>'Dołącz do innych ekspertów od WordPressa i podobnie myślących właścicieli witryn internetowych! Grupę prowadzi WPBeginner, największa bezpłatna witryna w WordPressie przeznaczona dla początkujących.','Join WPBeginner Engage'=>'Dołącz do WPBeginner Engage','Do you have an idea or suggestion for WPForms? If you have thoughts on features, integrations, addons, or improvements - we want to hear it! We appreciate all feedback and insight from our users.'=>'Masz pomysł lub sugestię dotyczącą wtyczki WPForms? Jeśli masz przemyślenia na temat funkcji, integracji, dodatków lub udoskonaleń, chętnie je poznamy! Cenimy sobie wszystkie uwagi i spostrzeżenia naszych użytkowników.','Text can\'t exceed %d character.'=>'Te