 want to duplicate this field?'=>'Czy na pewno chcesz zduplikować to pole?','(copy)'=>'(kopia)','Please enter a form name.'=>'Wpisz nazwę formularza.','or'=>'lub','is'=>'jest','is not'=>'nie jest','not empty'=>'nie puste','contains'=>'zawiera','ends with'=>'ma zakończenie','Previous'=>'Wstecz','Create new rule'=>'Utwórz nową regułę','Add New Group'=>'Dodaj nową grupę','Delete rule'=>'Usuń regułę','Hide Smart Tags'=>'Ukryj tagi inteligentne','--- Select Choice ---'=>'--- Wskaż opcję do wyboru ---','Countries'=>'Kraje','Countries Postal Code'=>'Kod pocztowy kraju','States Postal Code'=>'Kod pocztowy stanu','Days'=>'Dni','Now editing'=>'Trwa edytowanie','Preview'=>'Podgląd','Fields'=>'Pola','Add Fields'=>'Dodaj pola','You need to <a href="#" class="wpforms-panel-switch" data-panel="setup">setup your form</a> before you can manage the fields.'=>'Aby umożliwić zarządzanie polami, trzeba <a href="#" class="wpforms-panel-switch" data-panel="setup">skonfigurować formularz</a>.','Submit'=>'Prześlij','Standard Fields'=>'Pola standardowe','Fancy Fields'=>'Pola rozszerzone','You don\'t have any fields yet.'=>'Jeszcze nie ma pól.','You don\'t have any fields yet. Add some!'=>'Jeszcze nie ma pól. Dodaj jakieś.','Default'=>'Domyślny','You need to <a href="#" class="wpforms-panel-switch" data-panel="setup">setup your form</a> before you can manage these settings.'=>'Aby umożliwić zarządzanie tymi ustawieniami, trzeba <a href="#" class="wpforms-panel-switch" data-panel="setup">skonfigurować formularz</a>.','Install Your Payment Integration'=>'Zainstaluj integrację płatniczą','It seems you do not have any payment addons activated. You can head over to the <a href="%s">Addons page</a> to install and activate the addon for your payment service.'=>'Wygląda na to, że nie masz włączonych dodatków płatniczych. Możesz przejść na <a href="%s">stronę Dodatki</a>, aby zainstalować i włączyć dodatek do obsługi żądanej usługi płatności.','We need to save your progress to continue to the Marketing panel. Is that OK?'=>'Aby przejść do panelu marketingu, należy zapisać postęp. Zgadzasz się na to?','Are you sure you want to delete this connection?'=>'Czy na pewno chcesz usunąć to połączenie?','Eg: Newsletter Optin'=>'Na przykład: Zgoda na biuletyn','You must provide a connection nickname.'=>'Trzeba podać pseudonim połączenia.','Install Your Marketing Integration'=>'Zainstaluj integrację marketingową','It seems you do not have any marketing addons activated. You can head over to the <a href="%s">Addons page</a> to install and activate the addon for your provider.'=>'Wygląda na to, że nie masz włączonych dodatków marketingowych. Możesz przejść na <a href="%s">stronę Dodatki</a>, aby zainstalować i włączyć dodatek do obsługi swojego dostawcy.','Select Your Marketing Integration'=>'Wybierz integrację marketingową','Select your email marketing service provider or CRM from the options on the left. If you don\'t see your email marketing service listed, then let us know and we\'ll do our best to get it added as fast as possible.'=>'Wybierz dostawcę usług marketingu e-mail lub system CRM z opcji po lewej stronie. Jeśli lista nie zawiera używanej przez ciebie usługi marketingu e-mail, poinformuj nas o tym, a postaramy się ją jak najszybciej dodać.','General'=>'Ogólne','You need to <a href="#" class="wpforms-panel-switch" data-panel="setup">setup your form</a> before you can manage the settings.'=>'Aby umożliwić zarządzanie ustawieniami, trzeba <a href="#" class="wpforms-panel-switch" data-panel="setup">skonfigurować formularz</a>.','Submit Button Text'=>'Tekst przycisku przesyłania','Submit Button Processing Text'=>'Tekst przetwarzania na przycisku przesyłania','Enter the submit button text you would like the button display while the form submit is processing.'=>'Wpisz tekst przycisku przesyłania, który ma być wyświetlany podczas przetwarzania danych związanego z przesyłaniem formularza.','Form CSS Class'=>'Klasa CSS formularza','Enter CSS class names for the form wrapper. Multiple class names should be separated with spaces.'=>'Wpisz nazwy klas CSS opakowania formularza. Nazwy należy rozdzielać spacjami.','Submit Button CSS Class'=>'Klasa CSS przycisku przesyłania','Enter CSS class names for the form submit button. Multiple names should be separated with spaces.'=>'Wpisz nazwy klas CSS przycisku przesyłania formularza. Nazwy należy rozdzielać spacjami.','Enter your form name here&hellip;'=>'Tutaj wpisz nazwę formularza&hellip;','Form Entries'=>'Wpisy formularza','Form Templates'=>'Szablony','Smart Conditional Logic'=>'Inteligentna logika warunkowa','Marketing Integrations'=>'Integracje marketingowe','Payment Forms'=>'Formularze płatności','Surveys & Polls'=>'Ankiety i sondy','Advanced Form Features'=>'Zaawansowane funkcje formularza','Getting Started'=>'Pierwsze kroki','Hello and welcome to WPForms, the most beginner friendly drag & drop WordPress forms plugin. At WPForms, we build software that helps you create beautiful responsive online forms for your website in minutes.'=>'Witamy w WPForms – najbardziej przyjaznej dla początkujących wtyczce formularzy kontaktowych do WordPressa opartej na technice przeciągania elementów. W WPForms tworzymy oprogramowanie, za pomocą którego możesz w kilka minut tworzyć piękne responsywne formularze online do swojej witryny internetowej.','Over the years, we found that most WordPress contact form plugins were bloated, buggy, slow, and very hard to use. So we started with a simple goal: build a WordPress forms plugin that’s both easy and powerful.'=>'Na przestrzeni lat zaobserwowaliśmy, że większość wtyczek formularzy kontaktowych do WordPressa jest rozdęta, najeżona błędami, powolna i bardzo trudna w użyciu. Dlatego postawiliśmy sobie prosty cel: stworzyć wtyczkę formularzy kontaktowych do WordPressa łączącą łatwą obsługę i zaawansowane możliwości.','Our goal is to take the pain out of creating online forms and make it easy.'=>'Naszym celem jest eliminowanie czynników utrudniających tworzenie formularzy kontaktowych online i ułatwianie tego procesu.','Yup, we know a thing or two about building awesome products that customers love.'=>'Tak, tak, wiemy co nieco o tworzeniu fantastycznych produktów, które klienci wprost uwielbiają.','The WPForms Team photo'=>'Zdjęcie zespołu WPForms','Not Installed'=>'Nie zainstalowano','Creating Your First Form'=>'Tworzenie pierwszego formularza','Want to get started creating your first form with WPForms? By following the step by step instructions in this walkthrough, you can easily publish your first form on your site.'=>'Chcesz zacząć tworzenie pierwszego formularza przy użyciu wtyczki WPForms? Wykonując krok po kroku instrukcje zawarte w tym przewodniku, z łatwością opublikujesz w witrynie swój pierwszy formularz.','In the Forms Overview page, the forms list will be empty because there are no forms yet. To create a new form, click on the Add New button, and this will launch the WPForms Form Builder.'=>'Na stronie Przegląd formularzy lista formularzy będzie pusta, ponieważ nie ma jeszcze żadnych formularzy. Aby utworzyć nowy formularz, kliknij przycisk Dodaj, co spowoduje uruchomienie kreatora formularzy WPForms.','How to Add a New Form'=>'Jak dodać nowy formularz','WPForms is brought to you by the same team that’s behind the largest WordPress resource site, <a href="%1$s" target="_blank" rel="noopener noreferrer">WPBeginner</a>, the most popular lead-generation software, <a href="%2$s" target="_blank" rel="noopener noreferrer">OptinMonster</a>, the best WordPress analytics plugin, <a href="%3$s" target="_blank" rel="noopener noreferrer">MonsterInsights</a>, and more!'=>'Wtyczka WPForms jest dziełem tego samego zespołu, który stworzył największy serwis z zasobami dotyczącymi WordPressa – <a href="%1$s" target="_blank" rel="noopener noreferrer">WPBeginner</a>, najpopularniejsze oprogramowanie do generowania potencjalnych klientów – <a href="%2$s" target="_blank" rel="noopener noreferrer">OptinMonster</a>, najlepszą wtyczkę analityczną do WordPressa – <a href="%3$s" target="_blank" rel="noopener noreferrer">MonsterInsights</a> i nie tylko!','How to Customize Form Fields'=>'Jak dostosować pola formularza','How to Display Forms on Your Site'=>'Jak wyświetlić formularze w witrynie','Get WPForms Pro Today and Unlock all the Powerful Features'=>'Już dziś przejdź na WPForms Pro i uzyskaj dostęp do wszystkich zaawansowanych funkcji','Bonus: WPForms Lite users get <span class="price-20-off">50% off regular price</span>, automatically applied at checkout.'=>'Bonus: użytkownicy wtyczki WPForms Lite otrzymują <span class="price-20-off">zniżkę 50% od ceny standardowej</span>, która jest automatycznie stosowana na etapie płatności.','How to Choose the Right Form Field'=>'Jak wybrać właściwe pole formularza','Are you wondering which form fields you have access to in WPForms and what each field does? WPForms has lots of field types to make creating and filling out forms easy. In this tutorial, we’ll cover all of the fields available in WPForms.'=>'Zastanawiasz się, jakie pola formularzy są dostępne we wtyczce WPForms i jaką funkcję pełni każde z nich? WPForms oferuje wiele rodzajów pól ułatwiających tworzenie i wypełnianie formularzy. W tym poradniku omówimy wszystkie pola dostępne we wtyczce WPForms.','Read Documentation'=>'Zapoznaj się z dokumentacją','A Complete Guide to WPForms Settings'=>'Kompletny przewodnik po ustawieniach wtyczki WPForms','Would you like to learn more about all of the settings available in WPForms? In addition to tons of customization options within the form builder, WPForms has an extensive list of plugin-wide options available. This includes choosing your currency, adding GDPR enhancements, setting up integrations.'=>'Czy chcesz bliżej poznać wszystkie ustawienia dostępne we wtyczce WPForms? Oprócz mnóstwa opcji dostosowywania umieszczonych w samym kreatorze formularzy WPForms zawiera też długą listę opcji dotyczących całej wtyczki. Obejmują one wybór waluty, dodawanie rozszerzeń związanych z RODO czy konfigurowanie integracji.','How to Create GDPR Compliant Forms'=>'Jak tworzyć formularze zgodne z RODO','How to Install and Activate WPForms Addons'=>'Jak instalować i włączać dodatki wtyczki WPForms','Would you like to access WPForms addons to extend the functionality of your forms? The first thing you need to do is install WPForms. Once that’s done, let’s go ahead and look at the process of activating addons.'=>'Chcesz uzyskać dostęp do dodatków WPForms, aby poszerzyć funkcje swoich formularzy? Na początek musisz zainstalować wtyczkę WPForms. Jeśli już ją masz, przyjrzyjmy się procesowi włączania dodatków.','Feature'=>'Funkcja','Do you need to check that your forms are compliant with the European Union’s General Data Protection Regulation? The best way to ensure GDPR compliance for your specific site is always to consult legal counsel. In this guide, we’ll discuss general considerations for GDPR compliance in your WordPress forms.'=>'Chcesz sprawdzić zgodność swoich formularzy z Ogólnym rozporządzeniem o ochronie danych obowiązującym w Unii Europejskiej? Najlepszym sposobem na zapewnienie zgodności z RODO w określonej witrynie zawsze jest konsultacja z radcą prawnym. W tym przewodniku omówimy ogólne zagadnienia dotyczące zgodności z RODO w formularzach WordPress.','OptinMonster'=>'OptinMonster','WP Mail SMTP'=>'WP Mail SMTP','Entries via Email Only'=>'Wpisy tylko przez e-mail','Complete Entry Management inside WordPress'=>'Pełne zarządzanie wpisami w WordPressie','Powerful Form Logic for Building Smart Forms'=>'Zaawansowana logika do tworzenia formularzy inteligentnych','Basic Form Templates'=>'Podstawowe szablony formularzy','Limited Marketing Integration'=>'Ograniczona integracja marketingowa','Constant Contact only'=>'Tylko Constant Contact','All Marketing Integrations'=>'Wszystkie integracje marketingowe','Create Payment Forms'=>'Tworzenie formularzy płatności','Create interactive Surveys and Polls with beautiful reports'=>'Tworzenie interaktywnych ankiet i sond z pięknymi raportami','No Advanced Features'=>'Brak funkcji zaawansowanych','Limited Advanced Features'=>'Ograniczony zakres funkcji zaawansowanych','All Advanced Features'=>'Wszystkie funkcje zaawansowane','No Addons Included'=>'Brak dołączonych dodatków','Custom Captcha Addon included'=>'Dołączony dodatek własnego testu Captcha','Email Marketing Addons included'=>'Dołączone dodatki do marketingu e-mail','All Addons Included'=>'Dołączone wszystkie dodatki','Limited Support'=>'Ograniczona pomoc techniczna','Standard Support'=>'Standardowa pomoc techniczna','Unlimited Sites'=>'Nielimitowana liczba witryn','Heads up! Don\'t forget to test your form. <a href="%s" target="_blank" rel="noopener noreferrer">Check out our complete guide</a>!'=>'Uwaga! Nie zapomnij przetestować formularza. <a href="%s" target="_blank" rel="noopener noreferrer">Zapoznaj się ze szczegółowym przewodnikiem</a>.','Select a form below to insert'=>'Wybierz poniżej formularz do wstawienia','Show form name'=>'Pokaż nazwę formularza','Show form description'=>'Pokaż opis formularza','Whoops, you haven\'t created a form yet. Want to <a href="%s">give it a go</a>?'=>'Niestety nie masz jeszcze utworzonego formularza. Chcesz <a href="%s">spróbować</a>?','WPForms Builder'=>'Kreator WPForms','WPForms Settings'=>'Ustawienia WPForms','WPForms Tools'=>'Narzędzia WPForms','Analytics'=>'Analityka','About WPForms'=>'Informacje o WPForms','Hey, I noticed you collected over 50 entries from WPForms - that’s awesome! Could you please do me a BIG favor and give it a 5-star rating on WordPress to help us spread the word and boost our motivation?'=>'Hej! Widzę, że liczba wpisów pozyskanych przez ciebie przy użyciu wtyczki WPForms przekroczyła 50 – fantastyczny wynik! Mam do ciebie OGROMNĄ prośbę: czy wystawisz naszej wtyczce 5-gwiazdkową ocenę w WordPressie, aby przyczynić się do jej popularyzacji i wzmocnić naszą motywację?','~ Syed Balkhi<br>Co-Founder of WPForms'=>'~ Syed Balkhi<br>Współzałożyciel WPForms','Nope, maybe later'=>'Nie, być może później','Hey, I noticed you created a contact form with WPForms - that’s awesome! Could you please do me a BIG favor and give it a 5-star rating on WordPress to help us spread the word and boost our motivation?'=>'Hej! Widzę, że udało ci się utworzyć formularz przy użyciu wtyczki WPForms – to wspaniale! Mam do ciebie OGROMNĄ prośbę: czy wystawisz naszej wtyczce 5-gwiazdkową ocenę w WordPressie, aby przyczynić się do jej popularyzacji i wzmocnić naszą motywację?','Please rate %1$s <a href="%2$s" target="_blank" rel="noopener noreferrer">&#9733;&#9733;&#9733;&#9733;&#9733;</a> on <a href="%3$s" target="_blank" rel="noopener">WordPress.org</a> to help us spread the word.'=>'Oceń wtyczkę %1$s <a href="%2$s" target="_blank" rel="noopener noreferrer">&#9733;&#9733;&#9733;&#9733;&#9733;</a> na <a href="%3$s" target="_blank" rel="noopener">WordPress.org</a>, aby przyczynić się do jej popularyzacji.','Settings were successfully saved.'=>'Ustawienia zostały zapisane.','Validation'=>'Weryfikacja','Integrations'=>'Integracje','Your license key provides access to updates and addons.'=>'Klucz licencyjny zapewnia dostęp do aktualizacji i dodatków.','License Key'=>'Klucz licencyjny','Include Form Styling'=>'Uwzględnij stylistykę formularza','Base and form theme styling'=>'Stylistyka podstawowa i motywu formularza','Base styling only'=>'Tylko stylistyka podstawowa','No styling'=>'Bez stylistyki','Load Assets Globally'=>'Wczytaj zasoby globalnie','GDPR Enhancements'=>'Rozszerzenia związane z RODO','Background Color'=>'Kolor tła','Carbon Copy'=>'Kopia do wiadomości','Validation Messages'=>'Komunikaty weryfikacyjne','This field is required.'=>'To pole jest wymagane.','Please enter a valid email address.'=>'Wpisz prawidłowy adres e-mail.','Number'=>'Liczba','Please enter a valid number.'=>'Wpisz prawidłową liczbę.','Confirm Value'=>'Potwierdź wartość','Field values do not match.'=>'Wartości pól są niezgodne.','Manage integrations with popular providers such as Constant Contact, Mailchimp, Zapier, and more.'=>'Zarządzaj integracją z popularnymi dostawcami, takimi jak Constant Contact, Mailchimp, Zapier i nie tylko.','Hide Announcements'=>'Ukryj ogłoszenia','Uninstall WPForms'=>'Odinstaluj wtyczkę WPForms','Welcome to WPForms'=>'Witamy w WPForms','Thank you for choosing WPForms - the most powerful drag & drop WordPress form builder in the market.'=>'Dziękujemy za wybranie wtyczki WPForms – najbardziej zaawansowanego na rynku kreatora formularzy do WordPressa opartego na technice przeciągania elementów.','Watch how to create your first form'=>'Zobacz, jak utworzyć pierwszy formularz','WPForms makes it easy to create forms in WordPress. You can watch the video tutorial or read our guide on how create your first form.'=>'WPForms umożliwia łatwe tworzenie formularzy w WordPressie. Zachęcamy do obejrzenia naszego poradnika filmowego lub przeczytania przewodnika — dzięki nim łatwiej ci będzie utworzyć pierwszy formularz.','Create Your First Form'=>'Utwórz pierwszy formularz','Read the Full Guide'=>'Przeczytaj cały przewodnik','WPForms Features &amp; Addons'=>'WPForms – funkcje i dodatki','WPForms is both easy to use and extremely powerful. We have tons of helpful features that allow us to give you everything you need from a form builder.'=>'WPForms łączy łatwą obsługę i ogromne możliwości. Oferujemy mnóstwo pomocnych funkcji, dzięki którym zyskujesz kompleksowy kreator formularzy.','Drag &amp; Drop Form Builder'=>'Kreator formularzy oparty na technice przeciągania elementów','Easily create an amazing form in just a few minutes without writing any code.'=>'W kilka minut możesz utworzyć znakomity formularz, nie pisząc żadnego kodu.','Start with pre-built form templates to save even more time.'=>'Aby zaoszczędzić jeszcze więcej czasu, zacznij od gotowych szablonów formularzy.','Responsive Mobile Friendly'=>'Responsywne formularze przystosowane do urządzeń mobilnych','WPForms is 100% responsive meaning it works on mobile, tablets & desktop.'=>'WPForms jest wtyczką stuprocentowo responsywną, a utworzone w niej formularze działają na telefonach komórkowych, tabletach i komputerach.','Easily create high performance forms with our smart conditional logic.'=>'Łatwo twórz zaawansowane formularze przy użyciu inteligentnej logiki warunkowej.','Instant Notifications'=>'Natychmiastowe powiadomienia','Respond to leads quickly with our instant form notification feature for your team.'=>'Szybko odpowiadaj potencjalnym klientom dzięki natychmiastowym powiadomieniom o formularzach.','Entry Management'=>'Zarządzanie wpisami','View all your leads in one place to streamline your workflow.'=>'Usprawnij pracę dzięki wyświetlaniu wszystkich potencjalnych klientów w jednym miejscu.','Payments Made Easy'=>'Łatwa obsługa płatności','Easily collect payments, donations, and online orders without hiring a developer.'=>'Łatwo przyjmuj płatności, darowizny i zamówienia online bez zatrudniania dewelopera.','Marketing &amp; Subscriptions'=>'Marketing i subskrypcje','Create subscription forms and connect with your email marketing service.'=>'Twórz formularze subskrypcji i łącz je z usługą marketingu e-mail.','Easy to Embed'=>'Łatwe osadzanie','Easily embed your forms in blog posts, pages, sidebar widgets, footer, etc.'=>'Łatwo osadzaj formularze we wpisach na blogu, na stronach, w widżetach na panelu bocznym, w stopce itp.','Spam Protection'=>'Ochrona przed spamem','Our smart captcha and spam protection automatically prevents spam submissions.'=>'Nasze inteligentne funkcje Captcha i ochrony przed spamem automatycznie zapobiegają przesyłaniu spamu.','See All Features'=>'Zobacz wszystkie funkcje','Form Abandonment'=>'Porzucenie formularza','per year'=>'rocznie','WPForms is by far the easiest form plugin to use. My clients love it – it’s one of the few plugins they can use without any training. As a developer I appreciate how fast, modern, clean and extensible it is.'=>'WPForms to zdecydowanie najłatwiejsza w obsłudze wtyczka formularzy. Moi klienci ją uwielbiają – to jedna z niewielu wtyczek, której mogą używać zupełnie bez przeszkolenia. Jako deweloper doceniam jej szybkość, nowoczesność, estetykę i rozszerzalność.','As a business owner, time is my most valuable asset. WPForms allow me to create smart online forms with just a few clicks. With their pre-built form templates and the drag & drop builder, I can create a new form that works in less than 2 minutes without writing a single line of code. Well worth the investment.'=>'Dla właściciela firmy czas jest najcenniejszym zasobem. Dzięki wtyczce WPForms mogę kilkoma kliknięciami tworzyć inteligentne formularze online. Wbudowane szablony formularzy i kreator działający na zasadzie przeciągania elementów sprawiają, że mogę utworzyć nowy, działający formularz w czasie nieprzekraczającym 2 minut, nie pisząc przy tym choćby linijki kodu. Bardzo opłacalna inwestycja.','View preview'=>'Zobacz podgląd','View entries'=>'Zobacz wpisy','Edit This Form'=>'Edytuj ten formularz','Number of forms per page:'=>'Liczba formularzy na stronie:','Forms Overview'=>'Przegląd formularzy','The callback function used for the %s setting is missing.'=>'Brakuje funkcji wywołania zwrotnego używanej na potrzeby ustawienia %s.','You\'re using WPForms Lite - no license needed. Enjoy!'=>'Korzystasz z WPForms Lite – do tego nie potrzeba licencji. Powodzenia!','As a valued WPForms Lite user you receive <strong>50% off</strong>, automatically applied at checkout!'=>'Doceniamy to, że korzystasz z wtyczki WPForms Lite, dlatego otrzymujesz od nas <strong>50% zniżki</strong>, która zostanie automatycznie zastosowana na etapie płatności!','Verify Key'=>'Zweryfikuj klucz','<a href="%s">Go to the full page</a> to view and submit the form.'=>'<a href="%s">Przejdź na pełną stronę</a>, aby zobaczyć i przesłać formularz.','WidgetDisplay a form.'=>'Wyświetl formularz.','WidgetWPForms'=>'WPForms','WidgetTitle:'=>'Tytuł:','WidgetForm:'=>'Formularz:',