e'=>'Wyświetl nazwę formularza','No'=>'Nie','Yes'=>'Tak','Would you like to display the forms name?'=>'Czy chcesz wyświetlić nazwę formularza?','Display Form Description'=>'Wyświetl opis formularza','Would you like to display the form description?'=>'Czy chcesz wyświetlić opis formularza?','Connection'=>'Połączenie','%s (Full)'=>'%s (imię i nazwisko)','%s (First)'=>'%s (imię)','%s (Middle)'=>'%s (drugie imię)','%s (Last)'=>'%s (nazwisko)','Select Account'=>'Wybierz konto','We also noticed that you have some segments in your list. You can select specific list segments below if needed. This is optional.'=>'Zauważyliśmy także, że twoja lista zawiera segmenty. W razie potrzeby możesz poniżej wybrać określone segmenty listy. Jest to opcjonalne.','List Fields'=>'Lista pól','Available Form Fields'=>'Dostępne pola formularza','Add New %s'=>'Dodaj %s','Could not connect to the provider.'=>'Nie udało się połączyć z dostawcą.','API list error: Constant API error'=>'Błąd listy interfejsu API: stały błąd interfejsu API','Please fill out all of the fields below to register your new Constant Contact account.'=>'Wypełnij wszystkie poniższe pola, aby zarejestrować nowe konto Constant Contact.','Click here for documentation on connecting WPForms with Constant Contact.'=>'Kliknij tutaj, aby wyświetlić dokumentację dotyczącą łączenia wtyczki WPForms z usługą Constant Contact.','Because Constant Contact requires external authentication, you will need to register WPForms with Constant Contact before you can proceed.'=>'Ponieważ Constant Contact wymaga uwierzytelniania zewnętrznego, przed przejściem dalej musisz zarejestrować wtyczkę WPForms w usłudze Constant Contact.','Click here to register with Constant Contact'=>'Kliknij tutaj, aby zarejestrować w usłudze Constant Contact','Authorization Code'=>'Kod autoryzacji','Account Nickname'=>'Pseudonim konta','Try Constant Contact for Free'=>'Wypróbuj Constant Contact bezpłatnie','Get the most out of the <strong>WPForms</strong> plugin &mdash;