or more information <a href="%s" target="_blank" rel="noopener noreferrer">see our documentation</a>.'=>'Aby uzyskać więcej informacji, <a href="%s" target="_blank" rel="noopener noreferrer">zapoznaj się z dokumentacją</a>.','The following code can be used to register your custom form template. Copy and paste the following code to your theme\'s functions.php file or include it within an external file.'=>'Poniższy kod umożliwia zarejestrowanie własnego szablonu formularza. Skopiuj i wklej ten kod do pliku functions.php motywu lub umieść go w pliku zewnętrznym.','Select a form to generate PHP code that can be used to register a custom form template.'=>'Wybierz formularz, aby wygenerować kod PHP umożliwiający zarejestrowanie własnego szablonu formularza.','Export Template'=>'Eksportuj szablon','You need to create a form before you can generate a template.'=>'Aby wygenerować szablon, należy najpierw utworzyć formularz.','Import'=>'Importuj','WPForms Import'=>'Import pliku WPForms','Select a WPForms export file.'=>'Wybierz plik eksportu WPForms.','files selected'=>'— wybrane pliki','No file chosen'=>'Nie wybrano pliku','Import from Other Form Plugins'=>'Import z innych wtyczek formularzy','Not happy with other WordPress contact form plugins?'=>'Nie podobają ci się inne wtyczki formularzy do WordPressa?','WPForms makes it easy for you to switch by allowing you import your third-party forms with a single click.'=>'WPForms umożliwia łatwą zmianę wtyczki, ponieważ pozwala importować formularze z innych wtyczek jednym kliknięciem.','No form importers are currently enabled.'=>'Obecnie nie są włączone żadne importery formularzy.','Select previous contact form plugin...'=>'Wybierz poprzednią wtyczkę formularzy kontaktowych...','Not Active'=>'Nie włączono','Please upload a valid .json form export file.'=>'Prześlij prawidłowy plik eksportu formularza w formacie .json.','Form Import'=>'Import formularza','Select the forms you would like to import.'=>'Wybierz formularze do zaimportowania.','Available Forms'=>'Dostępne formularze','Forms to Import'=>'Formularze do zaimportowania','Below is the list of form fields that may be impacted:'=>'Poniżej znajduje się lista pól formularza, których może dotyczyć ten problem:','The following fields are available in PRO and were not imported:'=>'Poniższe pola są dostępne w planie PRO i nie zostały zaimportowane:','The following fields are available in PRO and were imported as text fields:'=>'Poniższe pola są dostępne w planie PRO i zostały zaimportowane jako pola tekstowe:','The following fields are not supported and were not imported:'=>'Poniższe pola nie są obsługiwane i nie zostały zaimportowane:','System Information'=>'Informacje o systemie','Test SSL Connections'=>'Przetestuj połączenia SSL','Click the button below to verify your web server can perform SSL connections successfully.'=>'Kliknij poniższy przycisk, aby sprawdzić, czy twój serwer internetowy może skutecznie nawiązywać połączenia SSL.','Test Connection'=>'Przetestuj połączenie','%s template'=>'Szablon %s','Site Administrator Email'=>'Adres e-mail administratora witryny','Embedded Post/Page Title'=>'Tytuł osadzonego wpisu/strony','Embedded Post/Page URL'=>'Adres URL osadzonego wpisu/strony','Embedded Post/Page ID'=>'Identyfikator osadzonego wpisu/strony','Query String Variable'=>'Zmienna ciągu zapytania','User Full Name'=>'Imię i nazwisko użytkownika','Author ID'=>'Identyfikator autora','Referrer URL'=>'Adres URL strony odsyłającej','Login URL'=>'Adres URL logowania','Logout URL'=>'Adres URL wylogowania','Register URL'=>'Adres URL rejestracji','Lost Password URL'=>'Adres URL utraty hasła','Grow Your Website with WPForms + Email Marketing'=>'Rozwijaj swoją witrynę przy użyciu wtyczki WPForms i marketingu e-mail','Wondering if email marketing is really worth your time?'=>'Zastanawiasz się, czy warto poświęcać czas na marketing e-mail?','Email is hands-down the most effective way to nurture leads and turn them into customers, with a return on investment (ROI) of <strong>$44 back for every $1 spent</strong> according to DMA.'=>'E-maile to zdecydowanie najskuteczniejszy sposób na pielęgnowanie kontaktów z potencjalnymi klientami i przekształcanie ich w klientów rzeczywistych. Jak podaje DMA, współczynnik zwrotu z inwestycji w przypadku e-maili wynosi <strong>aż 44:1</strong>.','Here are 3 big reasons why every smart business in the world has an email list:'=>'Oto 3 najważniejsze powody, dla których każda rozsądna firma na świecie ma listę mailingową:','<strong>Email is still #1</strong> - At least 91% of consumers check their email on a daily basis. You get direct access to your subscribers, without having to play by social media\'s rules and algorithms.'=>'<strong>E-mail to wciąż numer 1</strong>. Co najmniej 91% klientów codziennie sprawdza pocztę elektroniczną. Masz więc bezpośredni dostęp do subskrybentów bez konieczności przestrzegania reguł i algorytmów mediów społecznościowych.','<strong>You own your email list</strong> - Unlike with social media, your list is your property and no one can revoke your access to it.'=>'<strong>Twoja lista mailingowa należy do ciebie</strong>. W odróżnieniu od funkcji dostępnych w mediach społecznościowych lista stanowi twoją własność i nikt nie cofnie ci dostępu do niej.','<strong>Email converts</strong> - People who buy products marketed through email spend 138% more than those who don\'t receive email offers.'=>'<strong>E-maile to skuteczne narzędzie konwersji</strong>. Osoby kupujące produkty promowane w e-mailach wydają o 138% więcej od tych, które nie otrzymują ofert e-mailem.','That\'s why it\'s crucial to start collecting email addresses and building your list as soon as possible.'=>'Dlatego to ważne, aby jak najszybciej rozpocząć zbieranie adresów e-mail i tworzenie listy.','For more details, see this guide on <a href="%s" target="_blank" rel="noopener noreferrer">why building your email list is so important</a>.'=>'Aby uzyskać więcej informacji, zajrzyj do przewodnika wyjaśniającego, <a href="%s" target="_blank" rel="noopener noreferrer">dlaczego tworzenie listy mailingowej jest tak ważne</a>.','Here are the 3 things you need to build an email list:'=>'Oto 3 rzeczy, których potrzebujesz do tworzenia listy mailingowej:','A Website or Blog'=>'Witryna internetowa lub blog','High-Converting Form Builder'=>'Kreator formularzy o wysokim stopniu konwersji','The Best Email Marketing Service'=>'Najlepsza usługa marketingu e-mail','With a powerful email marketing service like Constant Contact, you can instantly send out mass notifications and beautifully designed newsletters to engage your subscribers.'=>'Mając dostęp do zaawansowanej usługi marketingu e-mail, takiej jak Constant Contact, możesz natychmiast przystąpić do wysyłania masowych powiadomień i pięknie opracowanych biuletynów sprzyjających zaangażowaniu subskrybentów.','Get Started with Constant Contact for Free'=>'Zacznij korzystać z Constant Contact bezpłatnie','WPForms plugin makes it fast and easy to capture all kinds of visitor information right from your WordPress site - even if you don\'t have a Constant Contact account.'=>'Wtyczka WPForms umożliwia szybkie i łatwe pozyskiwanie różnych rodzajów informacji o gościach bezpośrednio z witryny w WordPressie – nawet jeśli nie masz konta Constant Contact.','But when you combine WPForms with Constant Contact, you can nurture your contacts and engage with them even after they leave your website. When you use Constant Contact + WPForms together, you can:'=>'Jeśli jednak połączysz wtyczkę WPForms z usługą Constant Contact, zyskasz możliwość pielęgnowania kontaktów z odbiorcami i ich aktywizowania nawet po ich wyjściu z witryny. Łączne korzystanie z usługi Constant Contact i wtyczki WPForms daje następujące możliwości:','Seamlessly add new contacts to your email list'=>'Płynne dodawanie nowych kontaktów do listy mailingowej','Create and send professional email newsletters'=>'Tworzenie i wysyłanie profesjonalnych biuletynów e-mail','Get expert marketing and support'=>'Dostęp do specjalistycznego marketingu i wsparcia','Try Constant Contact Today'=>'Wypróbuj Constant Contact już dziś','WPForms Makes List Building Easy'=>'WPForms ułatwia tworzenie listy','When creating WPForms, our goal was to make a WordPress forms plugin that\'s both EASY and POWERFUL.'=>'Gdy rozpoczynaliśmy prace nad WPForms, naszym celem było stworzenie wtyczki formularzy kontaktowych do WordPressa łączącej ŁATWĄ OBSŁUGĘ i ZAAWANSOWANE MOŻLIWOŚCI.','We made the form creation process extremely intuitive, so you can create a form to start capturing emails within 5 minutes or less.'=>'Nasz proces tworzenia formularza jest wyjątkowo intuicyjny, dzięki czemu formularz umożliwiający rejestrowanie adresów e-mail możesz opracować w niespełna 5 minut.','Select from our pre-built templates, or create a form from scratch.'=>'Wybierz jeden z gotowych szablonów lub zacznij tworzenie formularza od podstaw.','Drag and drop any field you want onto your signup form.'=>'Przeciągnij dowolne pole do formularza rejestracji.','Connect your Constant Contact email list.'=>'Połącz listę mailingową Constant Contact.','It doesn\'t matter what kind of business you run, what kind of website you have, or what industry you are in - you need to start building your email list today.'=>'Nie ma znaczenia, jaką firmę prowadzisz, jaką masz witrynę internetową ani w jakiej branży działasz – już dziś zacznij tworzyć listę mailingową.','With Constant Contact + WPForms, growing your list is easy.'=>'Dzięki usłudze Constant Contact i wtyczce WPForms można z łatwością rozwijać listę.','reCAPTCHA is a free anti-spam service from Google which helps to protect your website from spam and abuse while letting real people pass through with ease.'=>'reCAPTCHA to bezpłatna usługa antyspamowa firmy Google, która pomaga chronić witrynę przed spamem i nadużyciami, a jednocześnie umożliwia łatwy dostęp ludziom.','<a href="%s" target="_blank" rel="noopener noreferrer">Read our walk through</a> to learn more and for step-by-step directions.'=>'<a href="%s" target="_blank" rel="noopener noreferrer">Zapoznaj się z poradnikiem</a>, aby uzyskać więcej informacji i instrukcje krok po kroku.','Logs'=>'Dzienniki','Form ID'=>'Identyfikator formularza','Entry ID'=>'Identyfikator wpisu','Author Name'=>'Imię i nazwisko autora','The %1$s %2$s contains over %3$s items (%4$s). This may make the field difficult for your visitors to use and/or cause the form to be slow.'=>'Obiekt %2$s typu %1$s zawiera ponad %3$s pozycji (%4$s). Może to utrudnić korzystanie z pola gościom i/lub spowolnić działanie formularza.','Available Fields'=>'Dostępne pola','This item must contain at least one choice.'=>'Ta pozycja musi zawierać co najmniej jedną opcję do wyboru.','Upgrade was successfully completed!'=>'Ulepszanie zostało ukończone!','To begin, you’ll need to be logged into the WordPress admin area. Once there, click on WPForms in the admin sidebar to go to the Forms Overview page.'=>'Na początek musisz się zalogować do obszaru administracyjnego WordPressa. Tam kliknij WPForms na panelu bocznym administratora, aby przejść na stronę Przegląd formularzy.','Thanks for being a loyal WPForms Lite user. <strong>Upgrade to WPForms Pro</strong> to unlock all the awesome features and experience<br>why WPForms is consistently rated the best WordPress form builder.'=>'Dziękujemy, że konsekwentnie korzystasz z wtyczki WPForms Lite. <strong>Kup WPForms Pro</strong>, aby uzyskać dostęp do wszystkich fantastycznych funkcji i przekonać się,<br>dlaczego wtyczkę WPForms stale uznaje się za najlepszy kreator formularzy do WordPressa.','Get the most out of WPForms by upgrading to Pro and unlocking all of the powerful features.'=>'Wykorzystaj w pełni możliwości wtyczki WPForms — kup Pro i uzyskaj dostęp do wszystkich zaawansowanych funkcji.','To unlock more features consider <strong><a href="%s" target="_blank" rel="noopener noreferrer" class="wpforms-upgrade-modal">upgrading to PRO</a></strong>.'=>'Aby uzyskać dostęp do większej liczby funkcji, rozważ <strong><a href="%s" target="_blank" rel="noopener noreferrer" class="wpforms-upgrade-modal">kupienie PRO</a></strong>.','Heads Up!'=>'Uwaga!','One or more of your forms contain fields that are not available in WPForms Lite. To properly import these fields, we recommend upgrading to WPForms Pro.'=>'Co najmniej jeden z formularzy zawiera pola niedostępne we wtyczce WPForms Lite. Aby te pola zostały prawidłowo zaimportowane, najlepiej kup WPForms Pro.','You can continue with the import without upgrading, and we will do our best to match the fields. However, some of them will be omitted due to compatibility issues.'=>'Możesz kontynuować import bez ulepszania planu, a my postaramy się dopasować pola. Jednak część z nich zostanie pominięta z powodu problemów ze zgodnością.','Continue Import without Upgrading'=>'Kontynuuj import bez ulepszania planu','Upgrade to the PRO plan to import these fields.'=>'Aby zaimportować te pola, kup PRO.','Stripe'=>'Stripe','Payment is required.'=>'Płatność jest wymagana.','Enable Conditional Logic'=>'Włącz logikę warunkową','Add your new form to any post, page, or sidebar.'=>'Dodaj nowy formularz do dowolnego wpisu, strony lub panelu bocznego.','Name'=>'Nazwa','Loading...'=>'Wczytywanie...','<strong>Please Note:</strong> Support for PHP 7.3 and below will be discontinued soon. After this, if no further action is taken, WPForms functionality will be disabled.'=>'<strong>Uwaga:</strong> Obsługa PHP w wersji 7.3 lub niższej wkrótce zostanie zakończona. Wówczas w przypadku niepodjęcia dalszych działań funkcje wtyczki WPForms zostaną wyłączone.','We know that you will truly love WPForms. It has over <strong>12,000+ five star ratings</strong> (%s) and is active on over 6 million websites.'=>'Wiemy, że autentycznie pokochasz wtyczkę WPForms. Ma ona <strong>ponad 12 000 pięciogwiazdkowych ocen</strong> (%s) i jest używana w ponad 6 milionach witryn internetowych.','All Form Templates including Bonus %s pre-made form templates'=>'Wszystkie szablony formularzy, w tym bonus w postaci %s gotowych szablonów','Multi-page Forms, File Upload Forms, Multiple Form Notifications, File Upload and CSV Attachments, Conditional Form Confirmation, Custom CAPTCHA, Offline Forms, Signature Forms, Save and Resume Form, Coupons'=>'Formularze wielostronicowe, formularze przesyłania plików, wiele powiadomień o formularzu, przesyłanie plików i załączniki CSV, warunkowe potwierdzanie formularza, własny test CAPTCHA, formularze offline, formularze podpisu, zapisywanie i wznawianie formularza, kupony','Load WPForms assets site-wide. Only check if your site is having compatibility issues or instructed to by support.'=>'Wczytaj zasoby WPForms w całej witrynie. Zaznacz tę opcję tylko wtedy, gdy w witrynie występują problemy ze zgodnością, lub na prośbę kogoś z zespołu pomocy technicznej.','Shortcode'=>'Krótki kod','CountryGeorgia'=>'Georgia','%d form was successfully restored.'=>'Przywrócono %d formularz.' . "\0" . 'Przywrócono %d formularze.' . "\0" . 'Przywrócono %d formularzy.','%d form was successfully duplicated.'=>'Zduplikowano %d formularz.' . "\0" . 'Zduplikowano %d formularze.' . "\0" . 'Zduplikowano %d formularzy.','User Email'=>'E-mail do użytkownika','form'=>'formularz','Page Break'=>'Podział strony','From Email'=>'Adres e-mail nadawcy','Hidden Field'=>'Pole ukryte','HTML'=>'HTML','Rating'=>'Ocena','Numbers'=>'Liczby','Entries'=>'Wpisy','Modern'=>'Nowoczesny','Required'=>'Wymagane','Confirm Email'=>'Potwierdź adres e-mail','Taxonomy'=>'Taksonomia','Delete Field'=>'Usuń pole','Connected'=>'Połączono','WPForms Lite'=>'WPForms Lite','Signature'=>'Podpis','Missing data'=>'Brakujące dane','Add New Notification'=>'Dodaj nowe powiadomienie','taxonomy'=>'taksonomia','Field Size'=>'Wielkość pola','Hide Label'=>'Ukryj etykietę','WPForms'=>'WPForms','Dismiss this message'=>'Odrzuć ten komunikat','Submit Feedback'=>'Prześlij informację zwrotną','Show Less'=>'Pokaż mnie