'=>'Tworzenie formularzy rejestracji i logowania użytkowników','MonsterInsights'=>'MonsterInsights','New Entry: %s'=>'Nowy wpis: %s','Thanks for contacting us! We will be in touch with you shortly.'=>'Dziękujemy za kontakt! Wkrótce się odezwiemy.','hCaptcha'=>'hCaptcha','Invalid form.'=>'Nieprawidłowy formularz.','Form has not been submitted, please see the errors below.'=>'Formularz nie został przesłany. Zapoznaj się z poniższymi błędami.','Uploaded files combined size exceeds allowed maximum.'=>'Łączny rozmiar przesyłanych plików przekracza dozwolone maksimum.','New %s Entry'=>'Nowy wpis: %s','Enter text for the form field label. Field labels are recommended and can be hidden in the Advanced Settings.'=>'Wpisz treść etykiety pola formularza. Zaleca się stosowanie etykiet pól. Można je ukryć w ustawieniach zaawansowanych.','Enter text for the form field description.'=>'Wpisz treść opisu pola formularza.','Check this option to mark the field required. A form will not submit unless all required fields are provided.'=>'Zaznacz tę opcję, aby oznaczyć pole jako wymagane. Do momentu wypełnienia wszystkich wymaganych pól nie będzie można przesłać formularza.','Enter code for the form field.'=>'Wpisz kod pola formularza.','Choices'=>'Opcje do wyboru','Add choices for the form field.'=>'Dodaj opcje do wyboru odpowiadające polu formularza.','<h4>Images are not cropped or resized.</h4><p>For best results, they should be the same size and 250x250 pixels or smaller.</p>'=>'<h4>Obrazki mogą zostać przycięte lub mieć zmieniony rozmiar.</h4><p>W celu zapewnienia optymalnych rezultatów powinny być tej samej wielkości i mieć maksymalnie 250x250 pikseli.</p>','Use image choices'=>'Użyj opcji do wyboru z obrazkami','Check this option to enable using images with the choices.'=>'Zaznacz tę opcję, aby razem z opcjami do wyboru używać obrazków.','Image Choice Style'=>'Styl opcji do wyboru z obrazkami','Select the style for the image choices.'=>'Wybierz styl opcji do wyboru z obrazkami.','