b użyj jednego z gotowych szablonów.','Check Notification Settings'=>'Sprawdź ustawienia powiadomień','The default notification settings might be sufficient, but double&#8209;check to be sure.'=>'Domyślne ustawienia powiadomień mogą być wystarczające, ale sprawdź, czy na pewno tak jest.','Add a Block'=>'Dodaj blok','Embed in a Page'=>'Osadź na stronie','Click the “Add Form” button, select your form, then add the embed code.'=>'Kliknij przycisk „Dodaj formularz”, wybierz formularz, a następnie dodaj kod osadzania.','Congrats, You Did It!'=>'Gratulacje, zrobione!','Rate WPForms on WordPress.org'=>'Oceń wtyczkę WPForms na WordPress.org','Yes, I give WPForms permission to contact me for any follow up questions.'=>'Tak, pozwalam WPForms na kontaktowanie się ze mną w sprawie ewentualnych pytań dodatkowych.','Skip challenge'=>'Pomiń wyzwanie','Cancel challenge'=>'Anuluj wyzwanie','Complete the <b>WPForms Challenge</b> and get up and running within %1$d&nbsp;%2$s.'=>'Ukończ <b>Wyzwanie WPForms</b> i rozpocznij pracę w %1$d&nbsp;%2$s.','Add Fields to Your Form'=>'Dodaj pola do formularza','WPForms Challenge'=>'Wyzwanie WPForms','%s remaining'=>'Pozostało %s','You completed the WPForms Challenge in <b>%1$s %2$s %3$s %4$s</b>. Share your success story with other WPForms users and help us spread the word <b>by giving WPForms a 5-star rating (%5$s) on WordPress.org</b>. Thanks for your support and we look forward to bringing you more awesome features.'=>'Udało ci się ukończyć Wyzwanie WPForms w <b>%1$s %2$s %3$s %4$s</b>. Podziel się swoim sukcesem z innymi użytkownikami wtyczki WPForms i pomóż w jej popularyzacji, <b>wystawiając jej 5-gwiazdkową ocenę (%5$s) na WordPress.org</b>. Dziękujemy za wsparcie! Zamierzamy wprowadzać kolejne fantastyczne funkcje.','Start Challenge'=>'Rozpocznij wyzwanie','Take the WPForms Challenge'=>'Weź udział w Wyzwaniu WPForms','Create your first form with our guided setup wizard in less than 5 minutes to experience the WPForms difference.'=>'Utwórz swój pierwszy formularz za pomocą kreatora konfiguracji w czasie krótszym niż 5 minut i przekonaj się o zaletach wtyczki WPForms.','Start the WPForms Challenge'=>'Rozpocznij Wyzwanie WPForms','You can use WPForms to build contact forms, surveys, payment forms, and more with just a few clicks.'=>'Korzystając z wtyczki WPForms, możesz przy użyciu kilku kliknięć tworzyć formularze kontaktowe, ankiety, formularze płatności i nie tylko.','Create Your Form'=>'Utwórz formularz','<strong>Note:</strong> The WPForms plugin is disabled on your site until you fix the issue. <a href="%s" target="_blank" rel="noopener noreferrer">Read more for additional information.</a>'=>'<strong>Uwaga:</strong> wtyczka WPForms w twojej witrynie została wyłączona do czasu rozwiązania tego problemu. <a href="%s" target="_blank" rel="noopener noreferrer">Przeczytaj więcej, aby uzyskać dodatkowe informacje.</a>','Multiple Choice'=>'Wybór wielokrotny','Paragraph Text'=>'Akapit tekstu','Confirmation Message'=>'Komunikat z potwierdzeniem','You do not have permission.'=>'Nie masz uprawnienia.','You do not have permission to perform this action.'=>'Nie masz uprawnienia do wykonania tego działania.','Items'=>'Pozycje','Single Item'=>'Jedna pozycja','Upgrade to WPForms Pro'=>'Kup WPForms Pro','Upgrade Now'=>'Ulepsz','Thanks for being a loyal WPForms Lite user. Upgrade to WPForms Pro to unlock all the awesome features and experience why WPForms is consistently rated the best WordPress form builder.'=>'Dziękujemy, że konsekwentnie korzystasz z wtyczki WPForms Lite. Kup WPForms Pro, aby uzyskać dostęp do wszystkich fantastycznych funkcji i przekonać się, dlaczego wtyczkę WPForms stale uznaje się za najlepszy kreator formularzy do WordPressa.','Once you upgrade to WPForms Pro, all future form entries will be stored in your WordPress database and displayed on this Entries screen.'=>'Gdy kupisz WPForms Pro, wszystkie kolejne wpisy formularzy będą zapisywane w bazie danych WordPressa i wyświetlane na tym ekranie wpisów.','Upgrade to WPForms Pro Now'=>'Kup WPForms Pro już teraz','We\'re sorry, the %s is not available on your plan. Please upgrade to the PRO plan to unlock all these awesome features.'=>'Niestety, pozycja %s nie jest dostępna w twoim planie. Kup PRO, aby uzyskać dostęp do tej i innych fantastycznych funkcji.','Last 90 days'=>'Ostatnie 90 dni','Create Your First Form to Start Collecting Leads'=>'Utwórz pierwszy formularz, aby zacząć gromadzić dane potencjalnych klientów','Upgrade to Pro and get access to the reports.'=>'Kup Pro i uzyskaj dostęp do raportów.','Total Entries by Form'=>'Łączna liczba wpisów według formularza','No entries were submitted yet.'=>'Jeszcze nie przesłano wpisów.','Show all forms'=>'Pokaż wszystkie formularze','Custom Field Name'=>'Nazwa pola własnego','Form Field Value'=>'Wartość pola formularza','Field Name'=>'Nazwa pola','Remove'=>'Usuń','Delete'=>'Usuń','Add New Connection'=>'Dodaj nowe połączenie','You do not have permissions.'=>'Nie masz uprawnień.','Missing required data in payload.'=>'Brak wymaganych danych w ładunku.','Your site is running an <strong>insecure version</strong> of PHP that is no longer supported. Please contact your web hosting provider to update your PHP version or switch to a <a href="%s" target="_blank" rel="noopener noreferrer">recommended WordPress hosting company</a>.'=>'Twoja witryna korzysta z <strong>niezabezpieczonej wersji</strong> języka PHP, która już nie jest obsługiwana. Skontaktuj się z dostawcą hostingu i poproś o zaktualizowanie twojej wersji PHP lub przejdź na usługi <a href="%s" target="_blank" rel="noopener noreferrer">zalecanej firmy zajmującej się hostingiem WordPressa</a>.','Email'=>'Adres e-mail','Upgrade to PRO'=>'Kup PRO','Small'=>'Mała','Medium'=>'Średni','Large'=>'Duża','Connect to %s'=>'Połącz z: %s','Message'=>'Wiadomość','We know that you will truly love WPForms. It has over 12,000+ five star ratings (%s) and is active on over 6 million websites.'=>'Wiemy, że autentycznie pokochas